"categorystrlist":"Mexican",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/aWQidmNnHQ6apkTIq5w8ZQ/l.jpg",
"rating":"4.0",
"reviewcomment":"D.e.l.i.c.i.o.u.s.!<br><br>After wandering into Frontera the evening before, I was sold on getting myself a R.B. fix.  Knowing that I&#39;d have to fight a line for lunch or dinner (and not wanting to order take-out and risk my food getting soggy), I settled on grabbing a bite around 2:30pm on a Saturday...  good choice as there was barely a line!<br><br>I decided to take advantage of the Chicago Craft Beer Week special torta...  smoked short rib.  The perfect combination of meat, toppings and an addictive side dipping sauce smothered between an awesomely crisp on the outside, soft on the inside baguette.<br><br>Not to miss out, I also ordered an Aztec hot chocolate with a churro on the side.  While the hot chocolate was a little too rich to finish the whole thing, it definitely was the best I ever had.  The churro was great, but I think I messed up by not getting the chocolate dipping sauce.<br><br>The only really negative part of Xoco is the ordering/seating system.  I&#39;m not sure if it&#39;s more efficient or not, but it&#39;s annoying to have to wait at the register to order until a seat is available (even if you&#39;re allowed to drink in line).",
