"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/hr61mHSdKevFzk4xd-2EmA/l.jpg",
"rating":"4.0",
"reviewcomment":"I love pizza, so I was very excited to try a Chicago deep dish pizza. I googled where to go and I found this place . It wasn&#39;t very busy when I went in with my family . We got seated immediately ( even with a party of 10).   We started with an appetizer combo(9$) which went fast, which didn&#39;t feel worth it but we did have 10 people share it . Then we orders 2 large pizzas (17.99 each just cheese .almost 2 dollars per additional topping) . The wait was 30 mins which was understandable since it&#39;s a deep dish and takes long to cook.  <br><br>So worth the wait! We didn&#39;t even finish the pizza( 2 slices left) because we were so full ! I loved the crust, I just wish it had more cheese. I already ordered extra cheese I just wanted more <br><br> Our server was very polite !<br>She was awesome and was quick with everything, she always keep us updated with the pizza time ! One thing I found odd was that she wasn&#39;t in any sort of uniform, so she just looked like a regular guest  in a oversized sweater . <br>Overall I really enjoyed my experience , it was my first time trying any Chicago style deep dish and look forward to comparing different places to find the best one for me",
