"rating":"4.0",
"reviewcomment":"Prepare to be amazed. I wanted to try this place for a while after hearing how good it was but never made much of an effort because, after all, wings are wings. Right?<br><br>Wrong. These wings are massive, and I don&#39;t mean grown on steroids and hormones. But healthy, meaty wings. Keep in mind 1 wing is considered both the thigh and the breast. <br><br>But can I talk about the sauce for a second? Holy moly. The sauces are to die for. Between 3 of us we tried the Sassy Seole, honey BBQ and medium buffalo. All 3 had more flavor and punch than any other wing sauce I&#39;ve tried before. Either way, you can&#39;t make a wrong decision here but none of the Honey BBQ wings were left at our table. Don&#39;t undermine the spicy. Even the honey BBQ had some spice to it. <br><br>Just enough crisp, plenty of meat and bountiful flavor. What more can I say?<br><br>Seating is family style, sharing tables with strangers and it gets pretty packed. Super friendly wait staff.  I&#39;m eager to go back for more!!",
