"rating":"4.0",
"reviewcomment":"Love the cozy ambiance at this place - it&#39;s dark, only lit with candles, and at every table there&#39;s a young couple looking deep in one anther&#39;s eyes. That said - this is a good spot to bring your date for a tasty dinner, in casual setting.<br><br>Food then? Must say I am not a huge steak eater. That said, I went for Norwegian salmon. It was a huuge portion with very creamy (yet delicious) sauce and mashed potatoes. Presentation, again very casual. Felt like something my mom would have put together a Tuesday night - in a good way.<br><br>Our waiter was good, and as with this whole experience, his service felt very authentic. It&#39;s a BYOB which you can like or not - at this place it works really well and our waiter quickly came out with a cooler to keep our white bottle at good temperature, and gladly gave us an extra set of wine glasses since we had a red bottle too.<br><br>Make sure you don&#39;t eat up everything on your plate cause you will most likely fall asleep - which does not make a good date!",
