"ogurl":"http://www.yelp.com/biz/sunda-chicago",
"categorystrlist":"Asian Fusion,         Sushi Bars,         Japanese",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/_tGkXOvdkmeXUYegtH4u6w/l.jpg",
"rating":"4.0",
"reviewcomment":"First, we have to thank our friend who gave us a gift certificate for this place as a wedding gift.  Without that, I&#39;m thinking we wouldn&#39;t have come.  But we did, and brought other friends, and had a blast.<br><br>The place is fancy but not over the top.  Downtown Chicago, so of course it&#39;s expensive, and crowded on a Saturday night.  Luckily Sweetie made reservations.<br><br>We were seated right around the time specified, and started right in.  A Yelp check-in yielded a free app, chef&#39;s choice, which turned out to be tempura jalapenos.  Very good, not very spicy.  We ordered some drinks, including a prickly pear cocktail for Sweetie (not bad,) and the day&#39;s special beer, a Japanese witbier (big, share-able bottles, pretty darn good.)<br><br>Let&#39;s see, we had so many things.  Some unagi, very good.  An unagi/foie gras combo, excellent.  Citrus scallops: pretty good, slightly spicy according to some of our group.              Yellowtail, very fresh.  A rainbow roll, one of the table&#39;s favorites.  Also the Tail of Two Tunas (we ended up getting another) and the pork and lobster roll (again, we had to get another- everyone liked this.)  Hm- Red Dragon and Firecracker: decent rolls, but just couldn&#39;t compare to those tuna and bacon rolls.<br><br>We were all stuffed.  Luckily for Sweetie, she stopped eating sushi before the rest of us, and ordered the night&#39;s dessert special: jasmine rice pudding with mango.  She savored it, and let me have a few bites.  Yow!  It was so good.  There was a superfluous crust at the bottom; the creamy rice and fresh mangoes were transcendent.<br><br>I think I stayed stuffed until the next afternoon.  We had a great time.  Great service, nice atmosphere (though it was painfully loud, so loud it was hard to talk till people started clearing out.)",
