"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/-1EkPNYM7pFZbfRliJVx3Q/l.jpg",
"rating":"4.0",
"reviewcomment":"The Good:<br>Fresh squeezed orange juice! Good coffee. Menu has a sense of humor! (&#34;cereal killers&#34; &#34;sammiches&#34; &#34;taters&#34;) Fresh hashbrowns. Fresh homemade breads, bagels, pastries! Beautiful modern, clean, open dining room with open kitchen so you can watch the cooks! <br><br>The Bad: <br>Expensive prices (cup of fruit was six dollars!!!!!) Heavy food.<br>I don&#39;t usually eat breakfast but if I do, I eat pretty light. Kinda hard to find lighter options on this menu, not many egg-less/meatless options....I love pancakes and French toast but all those options seemed overwhelmingly heavy &amp; complex (but were indeed creative)....so I went with sides (fruit, bagel, hashbrowns)<br><br>The Food: Hashbrowns are freshly grated to order and come automatically with cheese (I got mine without, as a light breakfast eater) -- portion was huuuge and the hashbrowns were for some reason so long I had to twirl them like spaghetti around my fork!  Breakfast was definitely fresh, yummy, and filling. <br><br>The Service: Professional, courteous, efficient, fast, coffee refilled, -- no complaints!<br><br>Overall:<br>Not cheap but hopefully worth it! I like the creativity, freshness and homemadeness. Nice modern restaurant, clean and bustling, pleasant atmosphere, good service, good coffee, good food. Recommended if you want to drop some cash on breakfast! Next time I go I&#39;ll try to be more hungry!",
