"reviewcomment":"Had dinner at Mercadito a few days ago with a group of 10.  I&#39;m vegan, so I&#39;d been looking at the menu for options and planned to go with the Hongos tacos and ask the waiter if there was cheese or other animal-based ingredients that could be left out.  But, it turned out our host ordered for the entire party.  When I told the waiter what I had planned to order to try to get something vegan, he said he&#39;d just have the chef make me vegan options of the various types of tacos they were preparing for the rest of our group.  It was great!  They made me several different types of vegan tacos, and all were fantastic!  Guac was excellent.  Great margaritas.  Excellent food and excellent service!<br><br>Only reason for 4 stars instead of 5 is that it&#39;s very loud.  The place would be well served to work on sound dampening the dining room.  It&#39;s difficult to hold a conversation over the noise.",
