"reviewcomment":"I have been DYING to try this place and LOVED it! My girl friends and I called early to find out the wait time and we came in at 1:30 p.m. (closes at 2) and got a table. They won&#39;t seat you until your whole party arrives. Once seated, our waiter approached us right away. My friends got orange juice and a bloody mary and my coffee in the &#39;Bongo Room&#39; cup was awesome. The service here is incredible- very fast paced. We were asked what we wanted 5 minutes into sitting and we were still looking at our menus but went with the chocolate tower french toast to share between the three of us and between the three of us we could only get through half of it. <br><br>They ran out of the special that included the lobster but we also went late towards ending time. I loved my croissant sandwich. I really loved it- but not everyone would agree for it being their favorite brunch spot. THe quick service and the rush is a little fast paced if you are looking for a more quieter and peaceful type of environment for the brunch but if you have time to wait- go for it! It&#39;s the Bongo Room- everyone has heard of it, so why not try?",
