"rating":"4.0",
"reviewcomment":"Loved the decor and vibe of this trendy spot.  We accidentally made the reservation for 9:30pm on Sunday instead of Saturday night and they were nice enough to accommodate!  The host got us a table within 10 minutes.  Granted, it was later but still there were people still waiting.  It was a nice welcome as that could have ruined the night!<br><br>We tried the blueberry version of a Moscow mule.  It was a little but sweet and had mint sprigs which some people didn&#39;t like.  I would get it again but after trying something else.<br><br>There were 5 of us and we ordered the prosciutto, lobster caprese- amazing!, Brussel sprout salad, Guliana salad, lobster ravioli- definitely must order! And the bucatini which was eh, ok.  I&#39;m not a fan of the thicker spaghetti pasta.  The Brussel sprout salad was amazing with avocado! The meatballs were ok but I prefer smaller vs large and soggy in the middle.  They were tasty so order them!<br><br>The veal chop was pretty amazing!  Then we had the affogato and hazelnut caramel heaven!  That was delicious!  The affogato- I&#39;d prefer to have got espresso so that if melts the gelato!  Service was great!  Will be back and recommending to others!",
