"rating":"4.5",
"reviewcomment":"Fogo is 5 Star outstanding!  The service is phenomenal and so is the food.  As other reviews have posted, don&#39;t fill up too much in the beginning on salad.  They bring mashed potatoes, polenta, and plantains to the table and the meats are all very filling.  All of the meats are fantastic and can be requested to your liking.  If you like a certain cut you can ask for that to be sent to your table.  Medium well?  No problem, just let any of your servers know.  <br><br>For a personal flare you can ask for your favorite condiments.  If you love bbq sauce or chimichuri they`ve got it. Their mixed drinks are also very good.  The cocktails run around $12, but they are heavy handed on the liquor so they are worth it. <br><br>Let them know if you are there for a special. occasion and they will ensure you have a special evening.<br><br>One of my favorite things was that as the menu states, it is a gaucho style restaurant (south American cowboys in the early 1900`s) one of the head servers is dressed like a gaucho with puffy pants and rugged boots.  This place certainly pays attention to details.",
