"rating":"3.5",
"reviewcomment":"Great place to grab dinner after work. Chill vibe, comfortable, fun. It&#39;s a little loud, but I&#39;m super loud so that works for me. Rockit has good happy hour specials if you are fortunate enough to get out of work between 3pm-6pm. <br><br>Had a 6pm reservation Monday evening. The hostess was super friendly and sat us right away. We were thrilled to discover that Monday is half off wine night, so we promptly ordered 2 bottles of Malbec. The service was great, our waiter was friendly, joked around with us, and never left our wine glasses empty (a huge + in my book). I had the goat cheese salad, which was delicious. Apparently they only have the Mac and Cheese burger on Tuesdays at the River North location so the girls were a little bummed but ordered the Farmhouse and the Locavore burgers and said were very good. We all wanted modifications to our meals; our server was super accommodating and didn&#39;t make us feel like we were being obnoxious or  high maintenance. He told us it was no problem and super easy to do! Rockit might be the new hang out for our standing Monday night dinner plans!",
