"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/mMLfpKJt73l2NwbqDgnPBw/l.jpg",
"rating":"4.0",
"reviewcomment":"I was in Chicago this past week on business, and had the pleasure of trying Greek Islands for the first time.  My fellow Yelpers did not lead my astray, as this was a damned good Greek restaurant!<br><br>I was dining alone so ate dinner at the bar, ordering from the weekly specials menu.  I had broiled whitefish prepared Greek style, in a light tomato sauce, with greek salad and rice &amp; potatoes.  Very yummy!  I also had the grilled octopus appetizer, which is the best I&#39;ve had since Kokkari Estiatorio in San Francisco (which is to frigging die for, BTW).  Very tender and tasty.<br><br>Most or all of the staff were Greek (duh, it&#39;s in Greek Town), and friendly.  The guy sitting next to me was Greek American, visiting from California, and seemed to have a similarly positive experience.  Will definitely try this place again on a future trip to Chicago!",
