"rating":"4.0",
"reviewcomment":"Again.....AMAZING. From the service to the food, Gibson&#39;s is superb! I don&#39;t know how they train their servers, but they always have this perfect presence of being very friendly and extremely efficient, but then they whisk away and are not overbearing at all. It&#39;s hard to describe, but I LOVE it!<br><br>The food is like none other. The only steak I&#39;ve tried is the Filet Mignon.......it literally melts in your mouth. We&#39;ve also tried the ribs, planked whitefish, and salmon sandwich. Each entree and side item that we have tried has been heavenly. We honestly don&#39;t think that Gibson&#39;s prices are disproportionate with the quality and amount of food that you get. The portions are huge.....especially compared to other fine dining establishments. The quality and preparation of the food is on a much higher level than many other fine dining establishments as well. <br><br>For the desserts, I have to start a separate paragraph : ) the desserts are HUMONGOUS and soooo good. Each portion is enough to feed 2-3 people......easy. The cake and pie slices are epic! The price that you pay is the same that you would pay for much smaller portions at most other restaurants. All of their desserts are homemade in the restaurant, from scratch as well......extra yummy!! Also, they are happy to cut the desserts into portions for everyone to share.",
