"rating":"4.0",
"reviewcomment":"I went to this restaurant yesterday night with my boyfriend. The environment is very nice, the decor is simple but classy. The food is quite good but not amazing. In particular, the starters are pretty tasty. We had a quail and vail sweetbreads. I really like the vail but the quail was a little tasteless. As main, we had monkfish and strip loin. <br><br>I would say everything is good but nothing is amazing that make you say: &#34;I want to go back&#34;. The desserts were very disappointing. We both thought that there was too much liquor... <br><br>The service was very good. Our waiter was very nice and she would not go to the table very often but you could clearly see that she was checking on us all the time. <br><br>At the end of the day, would i go back? probably yes, but I would not get any dessert. I think it is a good pick but for 130$/person, I think there are better ones in Chicago.",
