"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/zC0u-gTV28XUKTX7kgKk6g/l.jpg",
"rating":"4.0",
"reviewcomment":"I made a reservation for dinner based on the overall good Yelp reviews and I have to say my expectations were exceeded.  <br><br>The decor was very nice southern contemporary without being overdone.  The service was excellent from the minute we sat down to the time we left.  Unfortunately, I didn&#39;t get the name of our server, but she was attentive and knowledgable, but not overbearing.  <br><br>The food:  We started with the pimento cheese and corn bread.  The pimento cheese was very fresh and had some excellent pickled peppers mixed in.  The corn bread was out of this world.  It came with a salted butter that really made the flavor pop.  <br><br>There were 4 of us for dinner and all but myself got the pimento cheese burger.  They all raved about it and I snuck a bite which was the most melt-in-your-mouth burger I&#39;ve ever tasted.  I had the shrimp and grits which was excellent...great deep mushroom flavor with perfectly cooked shrimp.  <br><br>Overall, we had a fantastic experience and will definitely be back.",
