"reviewcomment":"I had to update my review even though its remaining the same number of stars.  I&#39;ve been here a handful of times now and I have to say that they are consistent no matter what time of day.  Also GT just may have the best dresses hosts in Chicago.<br>We came in for Easter brunch - well we came her on a Sunday for my friend&#39;s birthday and it happened to be Easter.  So it was a set menu, no choices except for drinks and add-ons.  We were so impressed! For $45 we had 9 dishes!  It started w/ churros, monkey bread and French toast.  Mmmm carbs!  Then shrimp, smoked fish quiche, and crab benedict.  At this point I was stuffed but no, there are three more dishes to go!  Chicken &amp; waffle, lobster roll and duck confit chilaquiles.  I didn&#39;t eat the chilaquiles because I don&#39;t eat duck.  The only small miss was the chicken.  It was pretty dry.  Everything else blew our socks off!  So very happy.<br>This place hits it out of the park in every way, every time.<br>I look forward to returning.",
