"reviewcomment":"Very solid experience at Sable!! Excellent food, chic ambience, but not too stodgy; and outstanding service......i&#39;ll take it any day!!<br><br>So, we experienced Sable for our latest date night dinner and we loved it. This is a small plate establishment, which I love because I like the option of tasting multiple dishes. We tried the Root Beer glazed Short Rib Sliders, Sweet Corn Creme Brûlée, and the Bourbon Chicken and Waffles.....each of these dishes was outstanding. The short ribs were tender. The chicken wasn&#39;t greasy. With each dish, we were able to taste the flavors of the individual ingredients and the combinations blended together so well. We ordered half-orders of each dish in 3 separate rounds and we were very full at the end of our meal. We&#39;ll definitely add Sable to our &#34;go-to&#34; list!",
