"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/shpjXYgzJ63Cwi-r4WaGeg/l.jpg",
"rating":"4.5",
"reviewcomment":"Been wanting to get here for sometime, finally made it and wish I&#39;d gotten here sooner. It&#39;s outstanding, creative, innovative and perfectly executed. It&#39;s small, hip comfortable space with a solid crowd waiting to get in but they turn the tables over in good time but without feeling rushed.  Very pleasant staff.<br><br>But...it&#39;s all about the food and these folks did not disappoint.  Wonderful selection of unique sweet and savory dishes and Sunday brunch specials such as Key Lime French toast, Mai Po Benedict, corn cakes etc.  My Tex Mex expert guy said they were the second best corn cakes he ever ate, and he would know.<br><br>My Mai Po Benedict was a perfectly balanced and executed combination of...here we go; Poached Eggs, English Muffin, Homemade Jerk Chicken Sausage Patties, Pineapple Chutney and a Lime-Annatto Hollandaise Sauce with a side of perfectly seared red potato hash browns.  <br><br>The other standout dish and house favorite (which are highlighted on the menu) was the Nuevo Omlette; Tomato, red onion, corn, goat cheese, salsa verde drizzled with sour cream.    <br><br>Over Easy Cafe has been an A+ player in weekend brunch for some time and now I understand why.  I&#39;m a fan. Complimentary coffee outside is both a class act and probably prevents the waiting mob from becoming unruly.",
