"rating":"4.0",
"reviewcomment":"Ughhhh.  Put a fork in me, Jerry!<br><br>After reading that Cemitas Puebla serves one of the best 21 sandwiches in the US, my mom and I knew we had to come here when we broke out of the airport on a 10 hour layover in Chicago.<br><br>I carried a heavy carry-on bag and wheeled a roller-board half way across the city just to get my hands on this sandwich.  And boy, I&#39;m glad I did.  My mom ordered the Atomica and I ordered the steak cemita.  Both were exceptional.  The chipotle salsa they have at the table really tops it off.  (Note: my mouth is watering just describing this).<br><br>After checking in on yelp we also got a free glass of Orchata.  This was described as &#34;homemade rice water&#34;.  I was hesitant, but after one sip, I&#39;m a believer.  It&#39;s like liquid rice pudding and it&#39;s hard to keep yourself from guzzling it by the gallon.<br><br>If you&#39;re visiting the Chicago area this is a sandwich worth seeking out!",
