"rating":"4.0",
"reviewcomment":"AMAAAAZING!<br><br>From start to finish, everything here is delicious! We made a reservation for my husband&#39;s birthday and we had to wait a bit because they were still cleaning our table. No problem with that though because we were able to have a wine flight at the bar and order one of those fun fruity mango drinks.<br><br>When we got to our table, our server explained everything to us since we&#39;ve never been there before. He started us out with some cheesy bread that came in what i thnk was a cast iron muffin pan. It&#39;s mini so you don&#39;t get a ton like Mom&#39;s Sunday breakfast. Loved the bread that I probably ate too much before actually eating dinner. <br><br>They offered a fresh salad bar and some soups to try but the best part was the meat and fish they serve throughout. We had a table near the kitchen which was surprisingly quiet but lucky for us, we were the first table out of the kitchen so everything we were served was still piping hot. I like trying all the different kinds of meat like the duck, chicken and steak but what&#39;s nice is they also offer you fish if you want something a bit lighter. They have everything that you would want for dinner and more and it&#39;s good for groups too",
