"reviewcomment":"We ordered the pork belly, duck fat fried chicken, and tonkotsu ramen. The food was well prepared but not authentic. The pork belly, while very delicious, was too sweet to be authentically Japanese. Duck fat fried chicken was very good. Ramen had a good flavor but the broth was more on the light side. And there was bok choy (not a fan) and no poached egg. :( I did like the mushrooms in the ramen though, they added a nice texture. The ramen was thin and cooked al dente, so plus there. <br><br>Aesthetics here get a 5. Food presentation was nice. I enjoyed the atmosphere. <br><br>FYI: restrooms are in the basement so a bit of a walk and isolated.",
