"rating":"4.0",
"reviewcomment":"Wildberry might be my new go to breakfast spot in Chicago from this point on. They have a huge menu, and a wide array of breakfast items you might not find in other spots.  For one, try one of the skillet dishes.  I had the veggie dish with hash browns on my last visit which was a delicious breakfast.  Other options include Eggs Benedict, Omelets, and Pancakes.  They also have really legit gluten free pancakes and I am not sure I&#39;ve ever had one that tastes like the real thing. Finally what tops this place off for me is that they have a full coffee bar which beats most breakfast spots who merely offer some crappy excuse for coffee.  This place has great cappuccinos, latte&#39;s, etc..  <br><br>The atmosphere is nothing to write home about.  It is like a big diner and might even pass for a Morrison&#39;s, but it is large, comfortable and is in a great location.<br><br>Go early or prepare to wait.",
