"reviewcomment":"A very nice Vietnamese/French restaurant if it sounds weird, look the history up.<br><br>So this is a nice upscale place that does say required attire, that may be just for dinner but not 100% sure. They have nice indoor and outdoor seating, we sat indoor since it was beautiful inside.<br><br>We tried two appetizers, the eggrolls and the beignets that were stuffed with shrimp, chicken and vegetables served with a orange ginger dipping sauce that we both excellent appetizers, happy that I got both of them.<br><br>The pho was one of the best that I tasted. They use oxtail based broth which is a nice rich touch. They chop their noodles in half which makes it easier to eat and they use homemade sriracha and hoisin sauce, how great is that? They should sell these sauces since they are so delicious. Very rich broth and lots of flavor.<br><br>For desert I had the banana wonton that is good as it sounds. Such a great desert and didn&#39;t expect anything less from this top notch restaurant.",
