"reviewcomment":"I used to live at Fulton and Halsted when I first moved to the city 4 years ago.  de cero, conveniently, was just around the corner.  What started as a normal affinity for a conveniently-located restaurant quickly turned into an unreasonable obsession within a few short months.  :)  I used to go there dining in or carrying out 3 times a week before I moved a bit further away.   <br><br>de cero&#39;s star employee, Sam, is always the highlight of every experience.  He anticipates what you need, he is so friendly, and I adore him so much -- he gets a hug each and every time I come...whether the poor man wants it or not.  :D  I&#39;ve had Kristy and Juan many times, as well...and they are competent and very friendly, too!<br><br>Back when I first moved here, I was a carnivore.  Then about a year and a half ago, I went vegan for health reasons.  Nearly any and all restaurants I once ate at became non options after my dietary change.  Well, a move to River North and a huge diet restriction list couldn&#39;t keep me away from this little West Loop Gem.<br><br>Carnivores:<br>-The most delicious taco you&#39;ll ever consume is the steak taco, and a close second is the battered shrimp taco.  Your face will melt after the mouth orgasm you&#39;ll immediately convulse into the moment this dish hits yo&#39; tongue, honey!  <br><br>Vegans/vegetarians:<br>-The black bean tacos are cruelty free, and so delicious that you don&#39;t miss the meat and cheese dishes for a second!  You can go with your meat eating friends and your eco friends alike...and everyone leaves fat &amp; happy!  :<br><br>Carnivores and Vegans: <br>-For an appetizer, make sure to get the black beans and rice, coupled with the lime verde sauce on the size.  A tortilla chip with a mound of black beans, rice, then drizzled verde sauce on the top: OH HOLY LORD!!  Healthy and delicious!<br>-The guac is always fresh, and so good!<br>-DO NOT LEAVE THIS PLACE without getting one of their made-by-God&#39;s-own-hands COCONUT MOJITOS!  <br><br>Great service, love the laid back (yet classy) atmosphere, and love the personalized service I&#39;ve gotten there since I moved to this beautiful city.  <br><br>Thanks, Sam -- you always treat my guests and I like kings and queens.  See you next week...as uuuuuusual!  :)",
