"rating":"3.5",
"reviewcomment":"Great neighborhood place with good food and an awesome drink selection. We went for dinner after a Sunday afternoon fundraiser and were happy to find that when we walked in around 6:00pm, we could still get a table for 6 people. The food was fantastic (I had the grilled cheese and it was phenomenal). Portions (for the sandwiches at least) are just right, not to big, but not too small. I also tried a bite of my friend&#39;s chicken pot pie and it was pretty good.<br><br>The menu is fairly expansive and I will have to go back just to try some other things since it was such a hard decision to make. The burgers looked so good!<br><br>They have both a vegetarian menu and a gluten free menu which is great for my group of friends since my other half is vegetarian and my friend has a gluten intolerance. It is rare that we can find a place that everyone has multiple options so this could become a usual place for us.<br><br>The only critique I have is that they were out of a few of the beers on the beer list that we tried to order. The friends I with are pretty big beer &#34;connoisseurs&#34; so they were quite bummed but other than that, there were no other issues.<br><br>Good food and a good atmosphere for hanging out and catching up with friends.",
