"reviewcomment":"One can say that I am such a sucker for breakfast that I am loose with my stars. NOT true. I am only loose with extra stars when there is good corned beef hash involved. Well this place got 5 stars and I didn&#39;t even get to eat CBH. It&#39;s  that good!!! (Wait what?? We are still talking about breakfast right???) <br><br>I love Melis. I have loved it for 4 plus years now. I didn&#39;t care how small it was or how long I had to wait.  The food is good. The staff is proffesional. Last time I was here I complained that they didn&#39;t have wheat grass. Guess what??? They took my constructive criticism and got wheat grass. It&#39;s like a semi OK  boyfriend you try to train/change, even tho technically there is nothing wrong with him. I swear some how this place just got better in my eyes, and it never was less then a 10. <br>Best breakfast in town hands down!",
