"reviewcomment":"The short: Great place for deep dish!<br><br>This was my first time having a deep dish, and wow! I&#39;m impressed! You Chicagoans are so lucky! We got a size small, half was the Lou (vegetarian), the other half was the Malnati Chicago classic. I didn&#39;t like how long it took to make, but man, it was so delicious! I&#39;m happy we ordered the chicken bbq club salad while we waited. Not only was it a filler, but it was a delicious filler! Great flavors.<br><br>The waitress was friendly, helping us out by cutting up the pizza and answering my friend&#39;s question. It turns out that the sausage that Lou&#39;s has both pork and beef (for religious reasons, my friend doesn&#39;t eat beef). That was a bummer, but she still enjoyed the vegetarian slices. <br><br>The lighting was dark, which was a bummer. I really wanted to take a quality picture with ample lighting to show friends what it looked like, but alas, it turned out dark and hazy. Oh well!",
