"reviewcomment":"I must agree that dining here is a very &#39;touristy&#39; thing to do. <br><br>Jannis&#39; definition of<br>touristy (verb) : doing all the cool shit<br><br>Bottom line, this is a pretty awesome place to be.<br><br>The food, scrumptious.  The service, impeccable.  The view, magnificent.<br><br>Spent a good chunk of change but it was well worth it.  Our $280 meal consisted of a few beers, a few glasses of wine, an appetizer, main courses, a few sides, a dessert, and coffees.  I&#39;m not complaining  because everything was GREAT.<br><br>I ordered the rack of lamb which was the most tender and moist rack I had ever eaten!  I am salivating just thinking about it.  I also order the duck trio which consisted of crispy duck thigh, seared foie gras, and duck liver mousse, again, salivating.  Edward enjoyed  his ribeye, which I personally thought was a tad above mediocre.  For dessert we both had a decadent white and dark chocolate  mousse cake.  <br><br>It was such a pleasureable experience dining atop the Hancock tower.  The view that accompanied the amazing food was literally to die for.  <br><br>If you&#39;re looking to save money  but still want to enjoy the view,  grab a few drinks at the Signature lounge.  They have a huge selection of drinks and a small selection of appetizers, sandwiches, and desserts.  <br><br>I am looking forward to going back to the Signature Room when I return to Chicago.",
