"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/CMI6yIvH0t00fqNrNApdvQ/l.jpg",
"rating":"3.5",
"reviewcomment":"From the other reviews, I get the sense Jerry&#39;s gets pretty nuts during the evenings and on the weekends and for that I think I&#39;ll avoid this spot at night. But for a midday lunch, it&#39;s a fantastic spot for a tasty and heavy bite to eat.<br><br>Dense, delicious &amp; satisfying are all words I&#39;d use to describe my Cajun Crawfish &amp; Salmon Burger. I chose the pretzel bun (duh) and asked for it to be additionally cajuned up via the &#34;cajun style&#34; $2 upcharge. The added hot sauce wasn&#39;t quite enough for my seasoned taste buds, so I liberally added some of the provided &#34;Chi-Racha&#34; which was really nice. <br><br>The burger was super duper filling. SO much so I pretty much regretted eating the entire thing so quickly. It hit me like a ton of bricks. A solid delicious punch to the gut if you will.<br><br>I went light on the sides with an order of the pickled veggies and the greens &amp; vinaigrette. Neither side really did anything for me, and I was particularly disappointed with the sweet pickling job of the veg. I expected tang and salt, not sugar. I should have asked though, so I&#39;m not docking any points on that.<br><br>My friends both got veggie sandwiches and it&#39;s here where I point out just how fucking huge and incredible the offerings are on the menu. Holy mother of god... it&#39;s almost too hard to pick from such a scatterbrained and expansive menu. But that&#39;s part of the fun if you ask me. So many offerings means repeated visits. Smart move Jerry!<br><br>As for the atmosphere... it&#39;s... quirky? The music was eclectic and at times awful. Service was great, though the restaurant was empty while we were there so there was time to pay attention to our table.<br><br>I&#39;ll be back!",
