"reviewcomment":"This review is for a custom cookie order. I saw cookies on Pinterest that I wanted to have replicated for a baby shower, so I emailed the photo to a couple of Chicago bakeries, including Alliance. <br><br>They were so quick to respond with a price quote (I emailed with Nora), and when I said that price per cookie was too high for me, they made suggestions about how the design could be tweaked to lower the price. <br><br>When I picked up the cookies (which were ready and waiting when they said they woudl be), I was blown away by how perfect they were! They were somehow even more amazing than the original picture I had sent in. The colors were awesome and the design was flawless. While custom designed cookies are never cheap, I would certainly go back to Alliance for a future order.",
