"rating":"4.5",
"reviewcomment":"2 friends had recommended this place so came for my post graduation dinner with family. Did not make a reservation, but was seated at a table for 4 at around 5:30 on a Friday. Very dark inside and reminded me of a speakeasy. <br><br>Ordered the filet mignon petite dutchess cut- soooo tender and cooked just right. They give you a mix of spices on the side with a creamy sauce as well, but honestly the steak is so flavorful already that you don&#39;t need it. Sister ordered the classic ribeye chicago cut and I liked hers so much we traded half way. Steak was very juicy and again cooked perfectly with no other sauces or spices needed. My mother ordered the chicken (I know who orders chicken at a steakhouse??), but surprised the roasted chicken was very tender and juicy. <br><br>For sides-Must try the elote style corn- has a cheesy and chili spice taste. The sweet potato side is very large! Loaded baked potato was also very large, but yummy and loaded with ham, cheddar cheese, and sour cream. <br><br>Was too full to try dessert =\ But def would come back.",
