"rating":"3.5",
"reviewcomment":"It was a last minute decision to go to the Rock Bottom Restaurant for lunch before we left the city, and it turned out to be a good decision!<br>We started off with the jalapeno pretzel sticks for an appetizer. These were the star of our lunch. Hand braided pretzels with pieces of jalapeno and cheese throughout served with a jalapeno spinach dip. Absolutely fantastic. If this review was just for the appetizer it would be a 5-star review. Unfortunately I wasn&#39;t as big of a fan of the burger I ordered as I wanted to be. I got the 2:00am burger which comes with bacon, egg and hashbrown, all on a burger. The concept sounded delicious and I had high hopes. The downfall was the use of a hashbrown patty underneath the hamburger patty, it made the bottom half of the burger way too greasy. This burger would be far better by using shredded hashbrowns instead of a McDonald&#39;s type patty.<br>My wife got a chicken sandwich that I tasted and that was very good.<br><br>We&#39;ll definitely be back for that appetizer!",
