"rating":"3.5",
"reviewcomment":"Food: 5<br>Alcohol: 4.8<br>Price: 5<br>Atmosphere: 4.5 <br>Staff: 5<br><br>I love this place- good ol&#39; Chicago Pub; don&#39;t confuse with local dive bars... Pretty old place, but definitely still upholds class. They don&#39;t need fancy shmancy gimmicks because this place sells quality.<br><br>Their food is good, and I mean fulfilling-ly good. Prices are also fair for the amount of food you get per order. I&#39;ve tried their lamb entree (YUM), fish and chips (best I&#39;ve had), ribs, seafood platter, calamari, and Reuben sandwich. All were pretty good and never have a been dissatisfied.<br><br>I can&#39;t speak for their beer selection as I don&#39;t drink beer... But wine mixed cocktails pretty good- they definitely don&#39;t hold back on their alcohol. <br><br>To make things even better, bar closes at 4a (in downtown?! What?! Crazy) and kitchen @ 2a (shut up and take my money!!!). <br><br>Weekdays or weekends, this place is packed all the time. Better call in to reserve. Unless you&#39;ll be sitting at the bar, then better hope they have a spot left. <br><br>I APPROVE OF THIS PLACE.",
