"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/TyJ-hHcVWeXb_qO5mXUwBg/l.jpg",
"rating":"3.5",
"reviewcomment":"We came here for a quick drink originally but saw other reviewer&#39;s comment on the XXX wings. We decided to try it and it became a once-in-a-lifetime experience.<br><br>My friend is a really experienced hot food eater and I&#39;m really bad at handling spicy food. When I first mentioned the name XXX, out server had an instinctive shiver and asked us &#34;are u sure?&#34; Heck yeah!<br><br>When it came up, the wings were dark in color and carries a light vinegar smell. I decided to taste the sauce and licked just a little bit. The initial flavor was mild but it was followed by everlasting intensive mouth burning sense. Just for a tiny bit of sauce, I had to wolf down my Heineken and water.<br><br>Regrouping my courage, I finally manned up and ate my wing as fast as I could. Net result - I had to clean my tears and sneeze in the restroom and keep ice water running through my mouth for a good 20 minutes!<br><br>And to worsen the situation, their kitchen close at 10pm and they were out of veggies. Looking forward for chapter 2 in the restroom next morning. And I will forever understand why our server had that instinctive shiver at the beginning.",
