"reviewcomment":"I have been a fan of Indie since it opened.  I used to frequent the Thai place in the spot before they took over; the move to Indie was a natural progression.<br><br>I am still one of their biggest fans.  I see the same people working in the restaurant and delivery.  That tells me quite a bit about staff treatment, etc. and I like it.<br><br>Indie has been fully embraced by Edgewater and works to keep the menu fresh.  They have NOT let this success go to their heads!  The lunch specials are still out of this world. High Quality. Low Price.<br><br>New Items do appear on the menu- I love the Jade Buddha appetizer.  Old favorites are reworked.  The spicy Tuna is now SPICY!!<br>The crab ragoon is still the best ever!<br><br>The Online ordering system takes some cash off your order- LOOK INTO IT!!!",
