"rating":"4.5",
"reviewcomment":"So it&#39;s kinda like a secret that everyone knows. If you walked into Bari your like oh a small Italian grocery store, but then theirs this deli counter in back and there it begins. The line that is. If it&#39;s anywhere near lunch time, there is a line down the aisle of people just waiting to give their order. Wait it out, worth the wait.<br>All one can say about the sandwiches at Bari is Wow! I&#39;m pretty damn sure they don&#39;t make a bad one, and if they did it would still best the hell out of the same sandwich anywhere else. The Italian is great, crusty bread, fresh sliced mortadella and prosciutto, and great gardinera. The meatball is very tasty and unique because it doesn&#39;t have a lot of sauce and the meatballs are soft, so they don&#39;t come shooting out when you take a bite. <br>But after coming here for over a year I discovered the be all end all of Bari sandwiches...their Italian beef! Holy flurking schnit! The twelve inch Italian beef with gardinera will change your life, and fill you up for the remainder of the day. This is one of the best beefs in the city, and I think that&#39;s saying something. It&#39;s super flavorful and really juicy, and for $8 you get a twelve inch piece of heaven.",
