"reviewcomment":"Bring on the French toast!!!<br><br>Try to get to Batter early as the line grows longer and longer as people wake up and casually accumulate outside. Although, it didn&#39;t seem like your roll out of bed, come in your pj&#39;s type place either. The men and women are dressed to impressed. I enjoyed observing everyone. On to the food. It&#39;s BYOB. They have great tasting smooth coffee. VERY ATTENTIVE staff- I am allergic to certain nuts and never had a waiter ask me if I were allergic to anything before I asked, let alone show me the actual dish I ordered on an iPAD. Interesting. Mom and I ordered the very popular French toast flight (including a soon to be gone pina colada French toast) My fave was the caramel.<br>We also shared crab cake benedict. Delicious and flavorful. Aha- the side of sautéed veggies we ordered last minute were great also, tender and perfectly seasoned. <br>I can&#39;t wait to go back and try everything else Batter and Berries has to offer.",
