"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/d67cOPdpWObcAshN0QaLzg/l.jpg",
"rating":"4.0",
"reviewcomment":"Oh Manny&#39;s....only my Mom would want to go to Manny&#39;s for her birthday.  Came here on a Friday for lunch, was pretty busy per norm.  Doesn&#39;t take long to get through the line.  For those who have never been, it&#39;s cafeteria setup.  Like being back in school, you grab a tray and pick tell the nice men behind the counter what you want.<br><br>We went with the usual...corned beef sandwiches, on rye.  Potato pancakes and a side of kishke or maybe it was a knish? I don&#39;t know, I didn&#39;t eat it.<br>The sandwiches are bigger then me, which isn&#39;t saying much.  I could barely get through half of a half.  I swear there was a pound of corned beef on that thing.  <br>The corned beef there is really good though, tender, not too fatty.  My Mom swears by the potato pancakes, they were good.  I am just not a fan of them in general.  Oh and if you check in on your Yelp app, you get a FREE potato pancake!<br><br>As an added bonus, they sell lottery tickets there!  I was feeling lucky, since it was my Mom&#39;s Bday and I bought 3 tickets.  One for my Mom, brother and myself....my bro and I didn&#39;t win, but my Mom won $20!!  Bday luck for sure.  Wish I could say that the $20 covered the bill, but no chance.  I wouldn&#39;t say Manny&#39;s is cheap, I think a corned beef sandwich is $12.00.  I will say that is absolutely worth every penny though. Plus the people watching is great there!",
