"rating":"4.0",
"reviewcomment":"I&#39;m a flexetarian at a conference in Chicago.  I made a reservation at a Brazilian Steakhouse, then changed to Karyn&#39;s at the last minute.<br><br>I was glad I did!  The atmosphere was bordering on swanky, but not stuffy.  The food was prepared with tender care.  I especially loved the brussel&#39;s sprouts, which were caramelized, smothered in a nice mustard sauce, and served on a sizzling platter.  Mmmmm, very nice!  And as I looked around the restuarant, I saw about a million orders of it, so I picked right.  Take my advice - get some as well!  The entree, chicken legs, was fairly faithful to the meat version, but not salty like a lot of frozen equivs are.<br><br>But what kicked it over the moon was the vegan creme brulee.  If you know creme brulee at all, you&#39;re going &#34;Huh?&#34;  But it was crispy on top, vanilla-y and creamy on the bottom.  Everything  you want in a creme brulee.  <br><br>The only restaurant that bested Karyn&#39;s on my trip was Two Restaurant.  But for a feel-good dinner, this really hit the spot.",
