"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/lEvVk2fyXzL6C-FjdCMh4w/l.jpg",
"rating":"4.0",
"reviewcomment":"This place is so cute! My cousin was going to get some takeout so we could stay in. Artopolis was one of the options she listed out for me, and when I checked out the Yelp pictures and reviews I just really wanted to experience it for myself. So we came here for dinner on a Tues night earlier this month, and it was one of the best meals I&#39;ve had recently. Zero complaints. I love the layout, decor, and ambiance. We chose to sit on the upper level by a window - I like that it gave us more privacy in addition to a view. We decided to share the Yuvetsaki and the Chicken Spinach Lasagna. I really, really enjoyed both, especially the Yuvetsaki. Definitely recommended! My cousin told me that they have a great dessert menu as well, so I ordered the berry yogurt mousse and it was the perfect amount of sweet and tart. I ended up finishing it. I don&#39;t remember what my cousin ordered, it might have been the bread pudding, I tried it and it was also really good, but more than a few big bites would have been too much for me.<br><br>I could see this being a great spot for a study session, coffee break, casual date, or as a place to get a cake. Instant love and I hope to make it back sometime.",
