"rating":"4.0",
"reviewcomment":"I&#39;ve only lived in Chicago for 7 months and I can&#39;t even count the number of times I have eaten at Taco Joint. This is my go to place for dinner or lunch out and my favorite place to grab some take out or delivery. <br><br>Margaritas are excellent. There are so many different kinds, although I will admit I almost always get the guava marg. I only wish I could get the marg to go when I&#39;m not eating in!<br><br>I made my way through each of the taco options and landed on my standard order: 2 enchilada tacos and 1 fish taco. I would seriously crave this combo. Unfortunately they changed up their menu 2 weeks ago and my beloved enchilada taco is gone. RIP enchilada taco. I&#39;ll just have to try them all out again to find my new order.<br><br>I&#39;ve also gotten various sides and apps: refried beans, rice, flautas. Everything is delicious. <br><br>Service is friendly in house. The restaurant is on the small side, so beware of peak hours cause you can wait. The bar is bright and there is lots of seating. There is a delivery charge, but the goods come quick and they are hot. And you can order online for pick up and delivery.",
