"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/A5pE56WnkHLHIWbzvqLIzw/l.jpg",
"rating":"3.5",
"reviewcomment":"I rarely give 5 stars, but this places, hands down deserve it!<br><br>Wine Recommendations:<br>Two Hands Brilliant Disguise 2012 Barossa Valley Moscato<br>Cave Spring 2010 Indian Summer Late Harvest Riesling <br><br>WOW... The Moscato was excellent.  If you like sweeter wines, like I do, both of the above are an excellent choice.  The Riesling was much sweeter than the Moscato.  <br><br>Appetizer Recommendations:<br>Frites Garlic-truffle-brown butter<br>Tempura Wisconsin Cheese Curds<br>Crispy Black Tiger Shrimp<br><br>My friend and I got the above and I recommend everything.  All are quite large portions and can be share between 2 to 3 people.  I have never had such amazing Cheese Curds (my #1 choice here).  I will be going back just for the Moscato and Cheese Curds.<br><br>We went on a Saturday around 10pm.  It was very nice out, therefore, in Chicago.. EVERYONE WAS OUT.  We only had to wait 15min (Very lucky).  However, parties of two (2) are much more likely to have less of a wait, we were told.  <br><br>Valet is only $14.  You cannot make reservations for parties under 8 FYI.  It is worth the wait. I PROMISE.<br><br>The decor inside is beautiful!!! It is relax and is a great date places or not our with the ladies. =))  <br><br>The BEST part about this place is that you are NOT rushed.  You can sit and relax and talk with the person(s) your with as long as you want.  Usually downtown can be pushy so that they can change people out.  Not here!  We were relaxed, not hassled and enjoy the Moscato for about 2 hrs.  <br><br>EXCELLENT!!!!",
