"reviewcomment":"A stellar restaurant with high quality food.  I think everything I had was remarkably delicious, and my fellow diners said this of their food as well.  <br><br>We went there early-ish on a Thursday evening, but it was still quite bustling.  I&#39;m glad we made a reservation.  <br><br>We got the calamari and the portabello e polenta to split as appetizers between the three of us, and it was absolutely delicious.  Even my co-worker who didn&#39;t like mushrooms liked the portabello dish.  The calamari was perfectly cooked: not too greasy or overdone/chewy, but very light and crisp and tender.  The bread that came to the table was warm and crisp and perfect.<br><br>For the main entree, I got the linguine with clams, and it was probably the best linguine with clams dish I&#39;ve ever had.  Rather than being drenched in butter and oil, it was perfectly light, fresh, and tasted like the ocean.  Delicious!  The pasta itself appeared to be totally homemade, which you can tell from the occasionally uneven shape.  Nothing better than fresh pasta!<br><br>I&#39;m always looking for a non-mediocre italian place, and I think I finally found it!",
