"rating":"4.0",
"reviewcomment":"Thank you &#34;Check, Please&#34; for the recommendation!!  My friends and I thank you! Buona Terra is a smaaaaaaaaal, cozy and feels like your in an Italian grandmothers home.  <br><br>Every dish that we ordered was perfection.  We started with  the fried calamari.  The batter was crisp without being heavy and the calamari, tender and not chewy. Friend one ordered Rigatoni Buona Terra: rigatoni pasta tossed in a sundried tomato cream topped with roasted walnuts and goat cheese. YUM!<br><br>Friend two ordered Gnocchi Verde al Quattro Formaggi: potato spinach dumplings in a four cheese sauce.  Also earns a big YUM!<br><br>Friend three ordered Rigatoni with Bolognese sauce.  Classic and perfect.<br><br>I ordered the Farafell Dominic: farfalle pasta tossed with asparagus, spinach, ricotta and parmesan cheese. WOWZA!<br><br>The portions are quite hearty so bring your appetite.  Unfortunately, we were stuff and had no room for dessert, which was a shame since a few things did catch my eye.  For the quality, and portions, the price is more than fair.<br><br>Apparently they have a Thursday night pre-fixe special, so I will be back to take advantage of that!<br><br>Until we meet again Buona Terra!",
