"rating":"4.0",
"reviewcomment":"This is our favorite place to get delivery from. Everything we&#39;ve tried is great, but our favorites are:  Yum Neau (grilled beef salad), Khao Soy (coconut curry w/ noodles), and Geang Dang (red curry).  We have a really hard time ordering other things because we love these so much!  Oh, their Crab Rangoon is delicious too! We&#39;ve also had the Pad See-lew, Pad Thai and Green Curry. All delish!  I tried the sticky rice with mango and while the flavors were good, I wasn&#39;t a huge fan. I think this may be best eaten in the restaurant. <br><br>One of these days, we&#39;ll have to have a real date night and go to the actual restaurant. We&#39;ve only eaten their takeout. I&#39;m sure fresh from the kitchen would be even better! <br><br>And if you&#39;re ordering delivery, call early! It usually takes about an hour or so.",
