"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Qb1-1NaOp_qTDh8zJUkX8w/l.jpg",
"rating":"4.0",
"reviewcomment":"First al fresco dining of the summer season, and it was fabulous. This place is located on busy State Street, but there&#39;s actually a decent amount of patio seating.  Our table was right against the building so we had more distance from the sidewalk (a good thing).  <br><br>As soon as we were seated we were given a basket of warm toasty bread, a plate of dipping oil, and glasses with a carafe of water.  Our waitress was really nice and attentive throughout our entire (long) meal.  <br><br>We split two salads: caprese and roasted beets. The caprese was fantasic - thick slices of roasted tomato topped with thick slices of fresh mozzerella + basil and olive oil.  Simple and delicious.  The beet salad was great and pretty too - the beets were dark purple and a lighter pink shade, served with toasted hazelnuts, blue cheese, greens and a light dressing.  <br><br>We opted for the pizza of the month (white &#39;za with goat cheese, sliced asparagus, an egg and truffle oil).  The pizzas are very thin and light and tasty.  The flavor combo on this pizza was so good - I wish I had another right now.",
