"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/9zsSxtyHoISK99bZClI6TA/l.jpg",
"rating":"4.0",
"reviewcomment":"Happy Mother&#39;s Day dinner surprise reservation!!! I&#39;ve wanted to go to Mexique since our kids ate here pre-Top Chef and once I watched Carlos compete on Top Chef, I really wanted to eat here. Fortunately I got to tell him myself as he visited our table that my expectations were very high for his food and he totally exceeded them!!<br><br>We started with a pitcher of their signature sangria and 3 delightful small plates: ceviche, which was super fresh and sauced perfectly; the tequila braised pork shoulder with an amazing mango habanero couli; the trio of sopes - escargot, plantain &amp; lamb sausage that were slightly tricky to split 4 ways but we managed pretty well. Honestly, every small plate was so uniquely tasty that we all raved about every single bite. <br><br>My entree was the braised pork belly and smoked sea scallops with mole, celery purée &amp; hibiscus glaze. Wow is all I can say! Everything complemented each other and was so expertly prepared it is one of the most perfect dishes it&#39;s ever been my pleasure to eat. <br><br>My family ordered the escolar, the lamb &amp; the whitefish special. All of them were equally enamored with their dinner choices. <br><br>What an amazing restaurant and Carlos is such a talented and personable chef! Totally worth the wait for a reservation.",
