"rating":"4.0",
"reviewcomment":"This is definitive my new favorite place....<br>I cannot come up with anything negative about this restaurant and the amazing  Saturday night me and my husband just had.<br>I don&#39;t even know how to start! <br>Ok let&#39;s mention it was during Cinco the Mayo period so that might have made it special.... but: <br><br>- People who work there are just incredibly fun, happy, professional and very attentive.<br>Our waiter was (i hope I&#39;m remembering his name correctly) Lucas and he was just AWESOME. He is one of the coolest waiter I ever had. Not just because he was fun but also very careful in making sure we were having a good time. For instance (I&#39;m almost embarrassed mentioning this) at a certain point, since I often talk and eat contemporarily, a bite of food went down the wrong pipe and I started choking. Lucas noticed it right away, he came helping me and he made sure everything was ok. Expected you would say.... well it still feels nice!<br>- The food was fresh and very tasty, especially their ceviches!!!!<br>- The selection of margaritas was very interesting and the drinks so well made and refreshing<br><br>For the Cinco the Mayo they opened the back patio, It really felt like summer and the atmosphere was just incredibly festive.<br>This is probably what I liked most, the feeling of happiness and fun spread around...<br><br>You should definitively consider going there if you are around Oak Park.<br>I cannot wait to go again!",
