"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/zfjHXuB-R05ETZnQqvpmXA/l.jpg",
"rating":"3.5",
"reviewcomment":"A group of 7 dined at Cafe Laguardia to say farewell to a dear friend.  He will be greatly missed....<br><br>He moved to Arizona...what were you thinking?!  This friend, lets call him Aaron G...no that&#39;s too specific, how about A. Greksa, loves Cuban food.  With it being his farewell party, he chose Cafe Laguardia.  I&#39;m glad he did!<br><br>The atmosphere in this restaurant is very energetic, but not crazy.  As soon as you walk in, your eyes dart all across the walls, trying to comprehend the variety of art that has been hung.  It&#39;s a mish mosh of Cuban culture, and definitely sets the mood for your evening.<br><br>The servers we had were very friendly and attentive.  Our table had a number of special orders, and they took care of everything.  The food was great as well.  I, of course, had a Cuban Sandwich.  Ashley ordered chile relanos (I know that&#39;s spelled wrong).  Other friends had fish, fajitas, burritos, etc....and I finished everything they didn&#39;t want.  It was really tasty.  <br><br>This being a Saturday night, there was live music in the bar.  Our dinner ended almost right at the start of the band, so we missed out on the dancing.  This is definitely a place I would like to come back to with another large group of friends/family.<br><br>They would&#39;ve gotten 5 stars, but their BYOB policy is $20/bottle.  4 stars it is :)",
