"reviewcomment":"Just to add my two cents, I really liked the pizza.  We got a 12&#34; with pepperoni and mushrooms.  The pepperoni was deeelish, as were the mushrooms.  So, I&#39;ve seen some complaints regarding the 1.50 per ingredient.  Yes, if you are not careful, it will be one expensive pizza. On the other hand, they do NOT skimp on the toppings - we got a ton of pep/mush on the entire pizza - making for a really good hearty slice.  As a matter of fact, they were so generous with the toppings I could only finish 2 slices.  We had the rest for dinner later that day - it reheated nicely on a griddle.  <br><br>I saw the mozzarella sticks - I may return one day with a friend just to share an order of those with a beer - they are huge and look yummy!  <br><br>Everyone who helped us was very nice - no complaints there.  The restaurant was very clean and I love the outdoor seating - and also like that we never felt rushed.",
