"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/WqtAz0KB21McS7n2IO7FlQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Had a wonderful date night at Balena. I cannot commend this place enough for their customer service. They go out of their way to make sure you have a special evening while dining there. Our server was excellent and made really good recommendations. We ordered a particular bottle of wine that they didn&#39;t have in stock and the sommelier came by and suggested a similar bottle of wine. <br><br>We started with the Kale Caesar salad which was really good. Then we shared the Spaghetti Cacio e Pepe which tasted like a grown-up&#39;s buttered noodles. It was okay, but I think I&#39;ll try a different pasta next visit. My girlfriend had the whole grilled branzino and the middle portion was de-boned which made it much easier to eat and enjoy. I hand the hanger steak which was also really good. The best course was our dessert, the chocolate and hazelnut crocannte. We don&#39;t usually get dessert, but I am glad we did this time. It was delicious!<br><br>The best part of the night was seeing Derrik Rose dining two tables away. From the look of it, he was really enjoying his meal as well.",
