"reviewcomment":"My husband and I came for an earlier Sunday dinner and the place was empty. Maybe it was still early.<br><br>We ordered a sangria and piña colada. I didn&#39;t try my husbands sangria but he said it was good. The piña colada was perfect, not too sweet, not too strong. Probably one of the best ones I&#39;ve had.<br><br>We ordered ceviche as an appetizer and it was delicious! It was very fresh and had the perfect taste. Chips and salsa were great, but they only give you a small thing of salsa.<br><br>Our server was Agustin, he was kind and friendly. He wasn&#39;t over bearing, but made sure we were well taken care of. <br><br>I ordered the flautas, which I was not excited about. The flautas are very big and thick. I&#39;m used to smaller, thinner ones, which I love because I think you can enjoy them better. The rice was ok.<br><br>Over all the place is nice and the staff is friendly, I would definitely go back and recommended.",
