"rating":"4.0",
"reviewcomment":"Let&#39;s start with how cute this place is.  It just feels &#34;rustica,&#34; or @ least whatever I assume &#34;rustica to feel like.  Hommie, comfy, warm... like you just walked into someone&#39;s home.<br><br>Althought not the most Italian of dishes, we started w/ the Nocci e Frutta.  In my efforts to be healthy, we got the most summery salad.  The sweet honey mustard tied the cranberries, carrots, greens, onions, &amp; pecans all together.  <br><br>Then, the Pizza Binaca - it was the kind of pizza that makes me wonder why deep dish is so popular.  Just the mozzarella, ricotta, &amp; spinach alone blew my mind - but then to add the lemon.  Wow, never thought to do that.<br><br>I&#39;m not a wine person - i love bourbon... and my my my my the Summer Rye was just sexy.  I had 3.  Bulleit, orange, ginger, mint.  There was a spice to the tongue, then just warm and smooth down my throat.  <br><br>Loved the service.  Everyone was incredibly nice, cool, calm.  Nothing was rushed.  You really felt like you were @ someone&#39;s home.",
