"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/dvSO2FolSGXKP00DvfWoLw/l.jpg",
"rating":"2.5",
"reviewcomment":"The Micro Mini breakfast is great. Two eggs and 1/2 meat. It comes with choice of pancakes, toast or english muffin. Oh... a side of potatoes comes with it, too.<br><br>For a guy that is eating paleo, two eggs with a side of meat is perfect. I asked for no potatoes and no toast... and I get a side of fruit. I was a little annoyed that I got an up charge for the fruit replacement (I gave up pancakes or toast or english muffin AND the potatoes) and I had to pay .99 more for fruit? I think if I&#39;m giving up a carb choice AND potatoes I should get fruit as a free substitute). <br><br>Alas, that&#39;s not how it worked out, but the service was good and attentive. It&#39;s breakfast food and it&#39;s good. We have only been here for breakfast so can&#39;t comment beyond.<br><br>We came here two days in a row for breakfast. It&#39;s not extraordinary, but it&#39;s quite good. If you stay at City Suites, like we do, and you want something beefier than the continental breakfast served up daily,which is great perk!, walk across the street to Clarke&#39;s for a nice breakfast.",
