"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/5wk7TA8GRAiyfzctK2poFQ/l.jpg",
"rating":"3.5",
"reviewcomment":"In a country where burgers are a religion, and that religion is relatively pagan, you&#39;d think that every grill man (or grill woman, ladies!) could prepare a decent burger. But sometimes simplicity is more difficult than complexity. Long-winded way of saying that Hackney&#39;s consistently makes a damned good burger. This time I had the Holy Guacamole burger (usually I&#39;m partial to the Bleu Cheeseburger): juicily medium rare, and it was a delight to try to tame it with two hands to get it into my pie hole. Delicious.<br>     Minus a star for the fries (of the coated variety--hey, let&#39;s let spuds be spuds!) and another for the boneless Buffalo wings: They had a good flavor (though the sauce could have been spicier), but there&#39;s something patently WRONG about a boneless wing--that just won&#39;t fly, in my book. Seemed more like Chicken HackNuggets. <br>     But add back a star because the burger&#39;s that good, and because of the sweet women (and man) who served us. We didn&#39;t get them this time, but the onion rings are delectable, even though they might have to wheel you out on a stretcher, yelling &#34;clear!!!&#34; as they defibrilate you. But each person has to decide what&#39;s worth dying for.",
