"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/RtlCJafgWI5jg61n88Cblg/l.jpg",
"rating":"4.0",
"reviewcomment":"Wasn&#39;t originally planning to go but after a one hour wait for Hot Doug&#39;s that I did not want to turn into three hours and then a stop by Kuma Corner where I faced another hour, stopped at the Pork Shoppe.<br><br>Was very happy I did.  Had the combo of 1/2 rack of babyback ribs and 1/2 rack of St Louis ribs.  Both were meaty and not too fatty.  Sauce is on the side, the sweet sauce was good but like a commercial BBQ sauce.  The tangy sauce was really interesting.  Did not try the hot sauce.<br><br>While the ribs were good, the mac cheese is what moved it from 4 to 4.5 stars.  It was fantastic, nice white cheese but really looked the crumbs on top.  Corn on the cob was also good.<br><br>So, ended 4.5 but the service moved rounded up to 5.  They were all very nice but when I wanted to take come some of my ribs, not only did they give me a box, but got BBQ sauces for me without asking and a bag.  Very good service that made the meal perfect.",
