"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/7gKiGc747yc-LnzEU8nXUA/l.jpg",
"rating":"4.0",
"reviewcomment":"I remember coming to this place back in high school and back then it had one of the biggest &amp; yummiest burritos I ever ate in my life. The thing took 2 days for me to eat and I brought it everywhere (trains, buses, school, etc.) It was a pleasant surprise because the place was a dimly lit (pretty much pitch black) dive with an ancient ATM machine and a few tables in the back. I could never find this place again though! It was straight out of a movie as I kept looking around the area over the years and searching the net, but it was simply gone... <br><br>Here we are about 7 years later and I stumble across an article about burritos in Chicago. I looked at the description of some places and thought this might be the one. To my delight it was! The place has cleaned up (it actually has lights now!), they turned it into a full sit-down restaurant by adding a lot more tables and expanding the place. Although I laughed because that same ancient ATM that I bet hardly anyone uses is still there collecting dust along the back wall. <br><br>They don&#39;t have the ground beef burrito anymore, just carne asada. The cashier was eager to take my order (asking me in both Spanish and English.) I got myself 2 super burritos one lengua (beef tongue), and one lomo (ribeye steak). She took my order down and rang my up for one burrito...which I corrected her for (would I have gotten a 2 for 1 deal if I hadn&#39;t? Dangit!). They took my credit card quick and easy.<br><br>The place was pretty busy, but still had that &#34;divey&#34; atmosphere, but in a good way. I got my burritos in about 10 minutes and was out the door. They&#39;re still huge and the restaurant threw in a ton of green pepper salsa. I dove right into these things once I got home. They were both cooked and prepared well, all the ingredients packed tightly together, nothing was sloppy. The lengua blended perfectly with the cheese, onions, lettuce, tomatoes, sour cream, guacamole, etc. Definitely will have this again on my next trip. The lomo while still good, I think they didn&#39;t make it a super burrito as it was filled with rice or its an entirely different recipe. <br><br>Whatever the case this place is going to be in my stable of restaurants. Right now it&#39;s the best burrito in my area and completely lived up to the taste I had on my mind all these years.",
