"rating":"3.5",
"reviewcomment":"Amazing! G &amp; G was at the top of our must do list while in Chicago.  The service from JJ was amazing. He had an assistant waiter and altough the place was packed, we were well taken care of.  We had the Chicken Parmesan and the Chicken Marsala.  <br><br>The ambience is dark and makes you feel like you stepped back in time and you&#39;re going to dine with an Italian mobster, (maybe you are?).  I loved it! <br><br>Secondly, the portions are huge! Two people could easily eat one dish, (although, you wouldn&#39;t get the joy out of trying someone else&#39;s food without the commitment).  Plus you get these delicious home fries and fresh bread. So good! The only complaint I had was the house salad just had lettuce, 1 tomato and my dressing...but I wasn&#39;t really there for the salad so I ate it quickly hoping I could just move on the main event. <br><br>For dessert we had the Tuxedo Cheesecake...There&#39;s really nothing to say other than we wished we would have taken a piece to go.",
