"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/Qb37fAak2oGshOitg3YitA/l.jpg",
"rating":"4.0",
"reviewcomment":"Awesome breakfast! They have a giant menu, literally pages long, with everything from sweet and savory crepes, to waffles, to insanely delicious looking fruit salads, and so on. They even have a bar and I noticed an apple mimosa that caught my eye. I fully intend to try it next time. <br><br>Yelpers raved about the crepes so I already knew that&#39;s what I would be ordering. Good luck deciding which one because they all sound wonderful. I picked one called the Tempting Trio, made with strawberries, bananas, and nutella. It was the size of my head and under $6. I think I was able to eat a quarter of it before calling quits. You can&#39;t beat that much delicious for such a small amount. Would be a great place to share food with friends and try a little of everything without breaking the bank. <br><br>I also ordered a sugar free vanilla latte that was creamy and fabulous. You would never guess it was sugar free. This is one of the coolest breakfast spots I&#39;ve been to in the city. The inside is welcoming, and you leave in a high of sugar and caffeine. Is there any better way to start the morning?",
