"reviewcomment":"had dinner last thursday evening - first time since the revamp.  we use to be regulars at the pump room for dancing and cocktailing, more so than dining, for probably over the past 20 years.  i was pleasantly surprised by the interior design and completely loving the light installations - simply marvelous.  we had a 6:30 reservation and by about 8:30 or so the lights are dimmed so low it is hard to see.  a bit too extreme.  <br><br>service was ok - not good to great.  for one of a number of instances, we ordered a second round of single glasses of pinot noir, prior to our entrees, yet we did not receive the glasses until we had completed our entrees and were moving to dessert.  the waiter offered no &#34;recovery&#34; - did not apologize and did not pick up the inappropriately timed glasses of wine.  he went on like nothing was wrong even though we made mention, he did not react.  <br><br>the food however was very good and out shown the service and poor lighting.  the guacamole, flatbreads, calamari, tuna tartare are fabulous starters with excellent presentations.  our entrees as well were delicious:  lamb, salmon, chicken, special fish - again all excellent with very nice presentations.  our sides were satisfactory:  creamy mashed and french fried potatoes.  <br><br>The birthday girl had carrot cake for dessert and ate the whole piece!  She said it was very good and again the presentation was a winner.<br><br>For the culinary experience a 5, for decor a 4, ambiance a 3 and service a 3 has me averaging my stars to a 4.  expensive but good.  i would go back and hope the service improves.",
