"reviewcomment":"Extravagant? Check<br>Disturbing, evocative and magical  -- all at once? Ditto. <br>An unforgettable night? Absolutely. <br><br>This is Moto. Weird. Outlandish. And awesome. <br>Thumbing through the other reviews will give you a sense of the scope. I didn&#39;t take pictures but all the other reviews really capture the idea. <br><br>Our server was delightful and made our group of 6 feel comfortable and welcomed, giving us advice on the order in which to tackle a new dish, or the rationale behind some of the selections. <br><br>We splurged in a crazy way. In a celebration mode we did the 14 courses. And the wine pairings. We stayed 4 hours and never felt rushed in any way. <br><br>I wish I could break the menu down for you, but really all I have is the memory of an amazing night. That seems enough.",
