"rating":"3.5",
"reviewcomment":"BRUNCHED AS FUCK <br><br>this dark gem was something I stumbled upon after once again being let down by the sketchville murder bathrooms of Discount Mega Mall across the street. I&#39;ve never been to this place but had heard it&#39;s a best bar that has some neat food. WELL GUESS THE FUCK WHAT!?!? This place carried the best Chicken and Waffles I&#39;ve ever even laid my eyes on AND YOU KNOW I WAS BONED UP FROM THE FLOOR UP ON THIS ONE!!! My lady and I were greeted with &#34;seat yourself&#34; which I&#39;m such a sucker for. Sitting in a large booth enough room for 3 or 4 Big Mac Bradley&#39;s to sit in. I had this Southern Belle come up to our table and just BLAST US WITH THE REALITY OF OUR OPTIONS! And I tell you what, this place has options. BUT IT WAS DECIDED! CHIX WITH DIX WAS WHAT I WANTED and it BLEW ME AWAY! The food in itself could kill the 15 year old virgin wanna be Tom Delong in all of us and the service COULD MOW DOWN AN ENTIRE LINE OF SELF CONSCIOUS FAN GIRLS WAITING FOR THE ONE DIRECTION SIGNING WITH AN AK-47 of southern charm! I not only want to take future Craigslist casual encounters here, but also my grandparents! NOW YOU TELL ME A PLACE THAT DOES BOTH OF THOSE FOR YOU! I&#39;m excited to return for some drinks but I will continue to pursue their food with the animosity of an elk consumed by chronic wasting disease!",
