"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/xFkAtsyBobo4tEl45OOHFQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I really love this restaurant, the decoration is not like the traditional japanese restaurant, and they have a open kitchen in the center that you can see everything making by the chef. I went there with my friend, and the restaurant is busy, though we walk in around 8:30pm, there are only a few tables are avaliable, thanks we didn&#39;t need to wait for a long time to get a table at that time. <br>Since it was really busy, we couldn&#39;t find our waiter when we were ready to order (our waiter approach the table fast which is good), but I think it&#39;s reasonable, later when the a few tables left, our waiter and busers come back to check the tables more often, but he really make sure that every single dishes come to the table is good, which I think it&#39;s good. The buser who delivered the food to our table gave us a short introduciton of the dish.<br>Food are delicious!!! We ordered 3 appertizers, the beef tataki in cold and the scallop in hot are wonderful!! We also order the sashimi chef seletion, fish are fresh and taste well. And the wild mushroom with rice which is in the pot, we saw that most ot tables ordered too, smells and taste very good, and it&#39;s with some basil and sauce. For the dessert, we ordered two dessert, one is good and the other is beautiful, I prefer the green tea one...lol.... but I forgot the full name...<br>In conclusion, both service and food are good, probably we ordered the right things to try? Anyway, I would like to come back again :)",
