"reviewcomment":"Cafe El Tapatio is a neighborhood spot for me. I&#39;m lucky that way. I like that it&#39;s not a taco stand, nor is it a noisy chain. It&#39;s a cute, small, authentic joint with really fresh ingredients. When was the last time you went to a Mexican restaurant and were served field greens instead of iceberg? See what I mean? I&#39;m one lucky girll!<br><br>The chips are good as is the salsa. I dig the rice too. And I&#39;m picky about rice. I recommend their plantain enchiladas with mole. I like their shredded chicken enchiladas too. I&#39;ve not spotted any fatty dark meat hidden in them, which can be a real turn off. I will have to try their fish tacos sometime soon! Their red sauce is a bit sweet for me but it doesn&#39;t stop me from ordering them. <br><br>While it&#39;s a popular place, I&#39;ve yet to see a line. They have a good patio so pile your pals in the car and head to Lakeview for some solid Mexican food.",
