"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/NdzoBx5jRfzVDNVWfKjrnw/l.jpg",
"rating":"3.5",
"reviewcomment":"My boyfriend and I got a Groupon for Stanleys. The first time we tried to use it, we were basically turned away because the bar had converted into a Blackhawks hub. We went back - made sure no Chicago sports teams were playing - and had an amazing dinner in the dining area (which is separated from the bar).<br>Monday&#39;s special is build-your-own burgers, an option which a lot of the other diners seemed to go for. However, since neither of us eat burgers, it didn&#39;t appeal to us - even though they offer turkey burger and chicken breast as alternate options. My boyfriend got a triple decker grilled cheese (which in my opinion looked pretty pedestrian, but which he enjoyed). I got the mac and cheese appetizer (which was enormous and delicious) and the pulled pork sandwich, which came with an apple slaw. The pulled pork was enormous and really really good - the best I&#39;ve had outside of Memphis. *Disclaimer - we ordered this much food because we were trying to use a $30 Groupon*<br>The meal ended up coming to 30.77 with tax (we got a beer to push it over the edge) so we got amazing value (even if we hadn&#39;t used a groupon) for the meal. We ended up taking the mac and cheese to go since it was too much to eat there.<br>Would definitely recommend for families or couples. If you are alone or want a more casual experience, the bar is nice as well. The lighting was great - not too dim, not too bright - and it was quiet enough that we could have a nice conversation.",
