"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/DqUKP3-i4__hSqDASJcq0g/l.jpg",
"rating":"3.5",
"reviewcomment":"Shocker! I went here for a bachelorette party! When I went on a Friday night around 10pm, it was all women in attendance throughout the Kit Kat Lounge. This is a place bachelorette parties, birthday parties and just groups of women in general come to let loose. <br><br>With our package, we got a tray full of delicious desserts plus 2 drinks each. The dessert tray was comprised of cupcakes, pies &amp; cake slices and rest assured we devoured it all. They have more martini options than I think I&#39;ve ever seen in my life. A lot of them were really creative and cool. The Lady Gaga comes with a glowstick! It really doesn&#39;t get better than that for a bunch of drunken bachelorette party girls. There&#39;s also a Reese&#39;s Peanut Butter Cup martini with a little peanut butter cup in it. They know what girls like!<br><br>The performers are divine! Seriously they get their groove on and are fabulous at involving the audience. Bring your dollah bills y&#39;all and show your gratitude for the hardworking ladies! My only gripe was we were there for three performances (they happened on the hour for about 15 minutes) and it was the same lady for all 3 performances. I would have liked to see a bit more variety.<br><br>Some kind of strange porn or something is playing on the walls throughout. All the servers were very nice and super quick, plus accommodating in letting us switch tables. <br><br>Pro-Tip: You want a seat in the front half of the lounge, that&#39;s where all the action goes down.",
