"rating":"3.5",
"reviewcomment":"I came to Silver Cloud last week for trivia and had a great experience.<br><br>Their Thursday night special is an $8 beer flight. I was really glad I ordered it and got to sample some beers that I normally would not have ordered or tried. It was also an awesome value for the price, I&#39;d highly recommend taking advantage of it if you like beer and are here on a Thursday.<br><br>I was not super hungry but wanted to try something on their menu (everything looked great) so I splurged and went with the Frito Pie. It was delicious and I really enjoyed their chili.<br><br>The ambiance and service at Silver Cloud also have to be mentioned. It is the perfect combination of bar and restaurant and I felt at home as soon as I walked in. It&#39;s a cozy place but the tables are spread far enough apart where you don&#39;t feel to cramped. Our waitress (wish I could get her name) was also stellar and took great care of us. <br><br>Definitely a fan of Silver Cloud and hope to be back soon.",
