"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/qq8g9QbxxzzAZMURRVEUZQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Was in Chicago for a week with my daughter and she decided she wanted to try a different pizza restaurant every day.  Not the healthiest week, but a lot of walking and we were on vacation....lucked into flo and santos when we were walking toward the end of the day and we found them on yelp a few blocks away.  Unusual dual specialties of pierogi and pizza, but we love both so we ordered the pierogi sampler and a pizza.  Fantastic pierogi and maybe even better thin crust pizza!  I had a couple<br>Local beers--skipped the vodka flight, but they have an impressive array of the spirit.<br><br>The final endorsement:  my daughter a few days later asked to go back rather than adding another pizza restaurant to her quest.  The thin crust was not what I would normally expect in Chicago, but our favorite of the five restaurants we had pizza from that week.<br><br>Great atmosphere, great food (only had the pierogi and pizza, though).  Have recommended to a few other groups visiting Chicago and all have loved it.  Definitely a neighborhood restaurant worth visiting!",
