"reviewcomment":"Turquoise is one of Chicago&#39;s best hidden gems.  Everything about this restaurant is charming: the cute location in Roscoe Village, the small interior, the cute outdoor patio and the sweet owner/head chef.  Pretty much everything on the menu is fantastic, my favorites are the lahmachun, beyti kabab and the steak.  Also, the waitstaff is always so wonderful here. We&#39;ve had a few mixups with our meal before, but they were very attentive and apologetic about it.  <br><br>They do private parties too. I threw a small graduation dinner for about 20 people a few years ago. We used their space in the basement and they were very accommodating. I brought my own linens, flowers and cake. We had a great meal with multiple courses and everyone had a really lovely time.  I would definitely throw another small party there.",
