"reviewcomment":"Oysy tops my list of favorite sushi places.  It&#39;s consistent in quality of food, service, and it has a casual yet upscale feel to it.  I&#39;ve been to this location several times, as well as the South Loop Oysy. <br><br>My friend and I dined here recently on a Saturday night to find only a slight wait while getting a table ready.  The non-waiting in this downtown area was a nice change of pace.  <br><br>We started with a few drinks, and then ordered the delicious ganmo soup - tofu tempura, tam noodle, mushroom, green onion with miso broth. I loved the large bites of the tofu tempura.   <br><br>We split four rolls that were all quite good, but by far my favorite was the Fire Cracker - shrimp, eel, cucumber, avocado, cream cheese, spicy tobiko, jalapeno - rolled an deep fried.  So good!  I could have eaten the entire thing myself. <br><br>Prices are fair, portions are average/generous, and it&#39;s just always good.  See ya soon Oysy!",
