"reviewcomment":"Definitely a lot better when you&#39;re able to grab a seat.<br><br>Went back to Howl after management was kind enough to send me a $25 gift card and a free admissions pass for me and a friend.  Went on a Saturday even around 5:30pm before having dinner with a couple of girlfriends and the place was pretty empty.  But hey, whatever.  I&#39;m glad I was able to get a table this time around.  We ordered a bucket of the margarita, and this thing was huge.  For $25/bucket, this thing is definitely more than enough for at least 4-5 people.  We managed to catch the beginning of the dueling pianos, and they were great--played a few request songs that almost everyone in the bar sang along to.<br><br>Kinda sad I was only able to stay for about an hour, but glad I was able to give Howl a t the Moon a second chance!",
