"categorystrlist":"Chocolatiers & Shops,         Sandwiches,         Bakeries",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Yu5kshy2z52sZzSYFccRCQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Let me start by saying that I HATE sandwiches. I always think there&#39;s too much bread, not enough flavor, too much meat, I don&#39;t like eating with my hands, and overall I never think the idea of eating a sandwich is appetizing. Last time I decided to order sandwiches for the office, I got some brie and duck breast sandwiches.... and I don&#39;t think people responded well-- I honestly think they would have rather had Jimmy John&#39;s or Potbelly&#39;s-- which again is the type of sandwiches I don&#39;t want to eat. <br><br>So I decided to give it another try and ordered some Hannah&#39;s Bretzel--- and it was a hit. We actually ran out of food and I had to get some pizza from a nearby restaurant to feed the monsters. The bretzel is soooo damn good. That is a type of bread that I enjoy eating. One of my directors was raving about Sergio&#39;s Special-- which is pretty good, I have to admit. <br><br>I only wish I had the chance to try one of each sandwich I ordered--- too many options. Only thing is these sandwiches are a bit on the pricier side... and the portions are smaller than you would expect from other sandwich shops.<br><br>Also, not so impressed with the desserts there. I would definitely get more bretzel sandwiches though! Who doesn&#39;t like pretzel bread?",
