"categorystrlist":"Pubs,         Irish",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/SbXv4sWjG3Sij_tN9DxEAw/l.jpg",
"rating":"4.0",
"reviewcomment":"This place is fantastic. All through April, they are having buy one/get one on their fish and chips on Fridays--so naturally, my boyfriend and I both got a half order. We also got their bacon and Guinness-cheese topped chips, which were delicious. During happy hour, the appetizers are all $5, so all told, our food only rang up to like $15.<br><br>Of course, we made up the difference by getting a ton of beer--and they have a decent beer menu. It&#39;s not the best I&#39;ve ever seen, but I was able to try some beers I hadn&#39;t had before (in particular, the Innis and Gunn oak-aged was pretty tasty).<br><br>The thing I liked the best about Fado, though, is the ambience. The interior is really cool and interestingly-shaped, and it had the atmosphere of a friendly pub without being overly loud or obnoxious. We will definitely go back.",
