"rating":"3.5",
"reviewcomment":"I used to come here for lunch back in the early 2000&#39;s, but when my office moved further away, it was like a yearly thing.  I realized I had not been in almost two years, so I headed back for lunch this week.  Yum!  Service with Anthony was amazing and we had three courses in just about an hour.  I started with the fritto misto - delicious.  My friend had the bean soup and liked it as well.  I then had the mussels  for my entrée and he had a steak salad - steak not cut-up was a nice touch.  Mussels were so many that I was truly full, but still had to try the maple and bacon donuts.  Those were a little overdone for my taste, but the blueberry sorbet my friend had looked super!<br><br>The menu is far smaller than it used to be, but I didn&#39;t have a hard time finding things I would like, and I am a picky eater.  Definitely come by for lunch or dinner if you are in the area.",
