"rating":"4.0",
"reviewcomment":"How in the hell did I live in walking distance of this place for 4 years and never been inside???<br><br>I was invited here by a friend yesterday that told me the place was a great option for pizza and beer. I like thin crust and good beer so I was like hell yeah. This place is great as you have to go downstairs as everyone has mentioned to a dungeon like atmosphere. It is very dim lit and has a nice, but romantic charm to it.<br>Due to it being Tuesday, they were having a half off bottle of wine special. Beer took a backseat as my dining companion beat me there and already ordered a bottle of pinot noir which was very good.<br><br>We got to choose our own table as it was a pretty light crowd at first...the place definitely filled up after we got our seats. We decided we wanted more than one flavor so we went with a half &amp; half pizza. We decided on the Painful (spicy pepperoni purple onion, fresh jalapeno, garlic, tomato sauce and mozzarella) and the Sweet Heat (chicken breast, bacon, diced jalapeno, smoked gouda, bbq-tomato sauce and mozzarella). The Sweet Heat was a good balance of sweet &amp; spicy while the Painful was slightly spicy...we enjoyed both!<br><br>I look forward to returning here to sample more pizza and to try the beer list.",
