"rating":"3.5",
"reviewcomment":"Been to Chicago a few times but have never noticed this place although they do have multiple locations.  Noticed their name on the side of one of the electronic recycling bins throughout the city with an arrow pointing me in their direction.  Thought I would give it a chance for a quick lunch. <br><br>PROS<br>-Location.  Easy access right off Michigan Ave.  WIthin walking distance of all main attractions.<br>-FAST! Placed my order, had a seat, and within 5 minutes an employee walked my order out to me.<br>-Outdoor benches.  Not much seating inside but the weather was perfect so we enjoyed the food right on the streetside. <br>-CHEAP!<br>-The burgers were pretty good and the fries were perfect.<br><br>CONS<br>-Birds. Pigeons. They&#39;re a bit too friendly around this area.  Entertaining for a while but gets a bit annoying when they jump up on your table hoping to get some fries.<br><br>I would go back on my next visit.  Loved this place.  Quick, easy and the price is right.  Perfect stop for lunch in between shopping and sight seeing.",
