"reviewcomment":"I&#39;ve been to the Chicago Chop House twice now while visiting from out of town and have had excellent meals and service both times. I selected the restaurant for my three friends so they would get an excellent dining experience and they were not disappointed. Our server and sommelier were very personable and attentive.<br><br>I had the Grand Cut (about 12 oz) filet and it was cooked to perfection. The meat was tender and practically melted in my mouth. <br><br>The ambience of the place is lively, with the best dining experience on the third floor where the quarters are a little more intimate than the open second floor.<br><br>Make reservations when you can, otherwise you might have to wait a long time to get a seat. You will pay a premium for the food, but it&#39;s a slightly better value than Morton&#39;s and you will have a more pleasurable dining experience eating in a piece of history that survived the Great Chicago Fire of 1871.",
