"rating":"3.5",
"reviewcomment":"I&#39;ve come here for their lunch buffets back when I was an unemployed bum, and enjoyed the experiences, but haven&#39;t been back until a groupon encouraged my return. And boy was I happy that I did so. <br><br>I came for dinner and was on a low carb kick so I tried their tandoori pesh kash appetizer as a meal and it was perfect. None of the meat items were dry, though tandoori chicken sometimes can be, and their variety was excellent. I did not miss the rice and naan at all, though I remember their naan being quite good and it is usually my favorite thing to order at an Indian restaurant. My dinner companion had a great experience as well. The service was polite and attentive and the decor was comfortable and beautiful. And they passed my biggest test of strong flavored places: I did not smell of Indian food afterwards! Bravo Indian Garden, I will be back again and again and again...",
