"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/Cvo-MTli3QACkrzbYI3bHQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Yum! There are only two reasons Havana doesn&#39;t get 5 stars from me. 1st is their house mojito and second was my dessert. That aside I immensely enjoyed my meal here tonight. I ordered the Ropa Vieja which is shredded flank steak cooked in garlic, bell peppers, and other spices. I don&#39;t care for bell peppers so I was a little skeptical but you can&#39;t taste them at all. It&#39;s simply super tender and incredibly flavorful beef. It came with white rice, black beans, and sweet plantains. I could eat this meal everyday and never get tired of it.<br><br>We started with their house mojitos and they were too bitter for me. That&#39;s usually my favorite drink, but they were so sour one sip made both my husband and I pucker our lips. Maybe try a flavored kind there. Those might be less harsh. <br><br>There was a free dessert yelp check in offer and the only thing we both agreed on from being stuffed was the strawberries in cream. I don&#39;t know what they make the cream out of but when I took a bite all I tasted was rancid milk. Almost like when you smell spoiled mayo. My husband ate the whole thing and enjoyed it so maybe something in my palate just wasn&#39;t playing nice tonight. Either way you need to eat here. The food was delicious",
