"reviewcomment":"Competitive pricing with less food portion in common ingredients and well seasoned balanced flavor.  Small Plates are out of fashion.  Loud.  Madhouse.  For one, it&#39;s easy to spend $47 for one drink and no brown bag.<br><br>Tips for an affordable satisfying meal:<br><br>SEARED HALIBUT ($19) -- perfectly seared with balanced flavor and good seasoning.  Hats off to Sous Chef Garcia.  The bigger portion of the small plates category.  An explosion of contrasting flavor and texture.<br><br>LE GRAND COURTAGE ROSE ($12) -- I am appreciative whenever Le Grand of whatever is available per glass.  Thank you!<br><br>Avoid, unworthy....<br><br>Side of Asparagus ($5) -- specks of cheese and few sticks of common asparagus is worth $3.<br><br>Pineapple Cake ($8) -- serves 2.  The buttery biscuit with topping of pineapple chunks in cinnamon caramel sauce.  Good light flavor.  For price, I expect a more complicated dessert preparation rather than flop a biscuit and pour topping.<br><br>* * *<br><br>SERVICE -- informative and knowledgeable.  Prompt water refill.  Quick cleanup.  Polite.  Beautiful Leah was encouraging on lunch menu.<br><br>UPSTAIRS BARTENDERS -- Nick and Travis are charming and knowledgeable that is hampered by madhouse vibe that starts at 6:30p on Friday.  It&#39;s amazing how attentive they are to crazed customers while uber busy.  Great team!<br><br>MENU -- something new and old every month to keep regulars from getting bored.<br><br>FRIDAY DJ -- lounge type music with ugly mishmash beats that is annoyingly noisy.  iTunes on random Shuffle.",
