"reviewcomment":"Once again Dru and crew continue to keep rocking!! This time I went a little crazy. After looking at the current soups I went a little crazy. First stopping at the Chicago Ave location. Picking up a Potato and Leek. Then went to the Broadway shop and got the Thick &amp; Rich bacon and potato and of course the White Cheddar and Broc. Got home and made my own blend. All I can say is, why didn&#39;t I get 2 of each?!?! If you&#39;re visiting or live here and haven&#39;t been I highly recommend you go. Whenever we have company in from out of town, first stop is Soupbox and second is Montis! You guys make this soup guy very happy!!! Thanks again for the years of getting me through illnesses, cold days, and just plain hunger!!<br><br>Oh and IMHO you have to try, when they have it, Cream of Asparagus, broccoli, white cheddar and the thick and rich potato! <br><br>#NomNomNomNomNom",
