"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/3miwCQg0mVCsZTOnMeMDew/l.jpg",
"rating":"4.0",
"reviewcomment":"This is the spot!! If you are looking for authentic cuban food you don&#39;t need to look any further!!<br><br>For starters you can find plenty of parking on the street and when you walk in the restaurant has a comfy, homey feel.<br><br>We started with the fried plantains with a garlic sauce and they were perfectly crisped and tasted right on spot!<br><br>For my entree I had the enchilado de camarones.  This was a shrimp cooked in a cuban creole sauce that the waitress was kind enough to ask me if I&#39;d like made spicy.  Of course I didn&#39;t argue a little extra heat!<br><br>The dish came with a side of black beans and rice as traditionally all plates come and this was a hefty helping for someone as small as me!<br><br>The shrimp were no joke and not stingy either.  The creole sauce was so flavorful you could lick it up with the bread at the table easily.  I would definitely come back if I wanted something made with heart and soul.<br><br>To end the meal I had a cuban coffee and let me tell you, if you need a coffee with a punch you will find a few extra punches in this brew! Delicious and the perfect way to end my meal!",
