"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/VgmTx5BIEb0zRfcxlS6e4Q/l.jpg",
"rating":"4.0",
"reviewcomment":"I can&#39;t say enough amazing things about Keefer&#39;s and am so sad it&#39;s closing in a few days.<br><br>Came here to celebrate a friend&#39;s birthday and had the best time. Our waitress was extremely knowledgeable and knew just what to suggest and what to pair with our entrees and drinks.<br><br>We started with the calamari and spicy mayo which was fantastic. I never like the squid-y looking ones so was happy there were some of the regular circular ones to choose from. The spicy mayo really hit the spot on this.<br><br>I tried a bowl of their red pepper soup which sadly wasn&#39;t that great, was super oily and I couldn&#39;t even eat all of it because I had to keep wiping the oil off my mouth. It was tasty but really, lay off that oil!<br><br>For my entrée I had crusted halibut which I believe was a special, boy was it amazing! Brought me right back to my honeymoon in Hawaii with how fresh that fish was. I couldn&#39;t stop eating it. Both my husband and our friend ordered a filet which looked so tasty and I don&#39;t even eat meat! We ordered a side of asparagus and a side of au gratin potatoes. Amazing, amazing. Shout out to our waitress for recommending those as sides to perfect our meal.<br><br>Once our waitress learned we were celebrating our friend&#39;s birthday she brought out a chocolate mousse with a candle in it for him, so cute and thoughtful. We also ordered the carrot cake which was out of this world.<br><br>Going to miss this place and hope its replacement keeps the staff on board.",
