"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/vGTDBVj4m1-ZvtxgckUl2w/l.jpg",
"rating":"3.5",
"reviewcomment":"I&#39;m between 3 and 4 stars for this one, but if I go back it will definitely be for more of a restaurant experience in which case this place is definitely a 4 star experience. I like being in the Southport area in general. It never feels overcrowded and there is plenty to do on that little strip between Roscoe and Irving Park. <br><br>I went to Mystic Celt to meet some friends for drinks. They were doing Corona buckets, so we jumped on that deal. I ordered some wings and my roommates got some sandwiches. The drink service was prompt, but the food came out really slowly (we thought they forgot about us for a while there). When the food did come out, it was hot and I really enjoyed my wings. They had some nice heat and were a good size. <br><br>The inside was really nice and the there were TVs for those who wanted them by the bar and then the rest felt more like a restaurant. We only went to share a few drinks, but sitting at a table it definitely felt like our time was limited. Service was pretty slow, too, so that was too bad. We liked our food enough to try it again for a meal next time. I think that&#39;s definitely the better choice seeing we liked the atmosphere for that reason even more. <br><br>There&#39;s rarely a line at the women&#39;s bathroom and the menu has a good variety of options as well as a clear theme--quality is consistent. We&#39;re excited to try it again.",
