"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/n0mgkOpy1xbazvrS9Dd_2Q/l.jpg",
"rating":"4.0",
"reviewcomment":"First off, the customer service was really good. I tried this place yesterday, for the first time. We had a reservation of 7 people for 730 and they immediately sat us once we got there, no wait. Being a BYOB we brought wine bottles and the server always made sure to open any bottle we needed. We also brought in a cake, for a birthday celebration, and they had no problem storing it in the back. We didn&#39;t wait long for our orders to be taken.<br><br>We had the ceviche mixto and the pulpo in olive dressing for appetizers and they both were AMAZING! I had the pollo Saltado, which was really good. Everyone else in my group loved their dishes as well. The portions were good and big, we all had leftovers. After they brought the cake out with candles and extra plates. <br><br>Overall it was a great first experience, and we will definitely be coming back. <br><br>On a side note their green salsa is by far the most amazing salsa I have had in a restaurant.",
