"rating":"4.0",
"reviewcomment":"Excellent little diner right by the Blue Line. I was in a fairly large group for a 6AM breakfast meeting on a Wednesday. Anastasia was on her own in the dining room with a handful of other tables and she was great. There was no shortage of coffee, nor glasses left empty. She was a genial hostess, which made my morning a little more pleasant.<br>Pancakes were awesome-you need to get the sweet lady special! Two eggs, meat, and a fruit pancake...the banana was too good. I thought I would miss hashbrowns, but my table of construction workers couldn&#39;t finish their meals with all the food.<br>Eggs over easy were almost cooked perfectly for my taste. One yolk broke on the griddle, but somehow the cook managed to salvage a little of the yellow inky goodness.<br>Nice that it&#39;s right off of the intersection with California, there&#39;s a small parking lot, and they pay street parking if it&#39;s full. I could easily see myself (if I took the Blue Line @ California) phoning ahead for a sandwich and coffee before getting on the eL.",
