"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/PZDAEu7ETHwGBe4GgsqjGw/l.jpg",
"rating":"3.5",
"reviewcomment":"This is hands down some of the best Lebanese food I&#39;ve ever had. I&#39;ve been coming to Maza for several years now, starting when it was at the old location on Lincoln. The food is consistent and fails to disappoint! I&#39;ve tried many menu items and would highly recommend the hummus, fattoush, baba ghannouj... And the kellaya, chicken brochettes, mixed grill kabob, and couscous. Oh, and the seafood grill is great too. IMO, you can&#39;t go wrong with the food here. If you&#39;re lucky, maybe you&#39;ll get some delish, complimentary baklava at the meal&#39;s end. The prices are reasonable especially with a groupon or similar deal.<br><br>As for the location/ service, I have to admit I preferred their old space better. However, I have had no issues with the owner. He runs essentially a one-man operation as far as being the host, waiter, and clearing the tables. He&#39;s not in-your-face friendly, and while this could possibly be misconstrued as being abrasive, I think it&#39;s just his personality. He has been nothing but polite, accommodating, and pleasant when I&#39;ve dined at Maza and really takes pride (rightfully so) in his Lebanese cuisine.",
