"categorystrlist":"Breakfast & Brunch,         Juice Bars & Smoothies",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/TlXjB--g3gs5VsXixNOkwA/l.jpg",
"rating":"4.0",
"reviewcomment":"Tiztal Cafe is by far my favorite brunch place in the city. I know that&#39;s a tall order considering the number of brunch places that the city has to offer, but they just do it for me. I pretty much get the same thing every time I go. I get the veggie omelet and the vampiro juice. Then I convince whoever I&#39;m there with to get the oatmeal shake because I don&#39;t want to be the guy that orders 3 drinks (I also order coffee). <br><br>I couldn&#39;t pick which item I like the most because they&#39;re all honestly that amazing. I really like my juice, but the potatoes at Tiztal are better than anything I&#39;ve had at any other restaurant. Then of course there&#39;s the oatmeal shake. It&#39;s truly a must try item. You won&#39;t be disappointed. <br><br>With all of those positive features, I will say that this restaurant isn&#39;t quite perfect. Their downfall that the service is a bit rough at times. Everyone is always friendly and helpful, but not always that attentive. It sometimes gets a little annoying, but I promise that the food will make up for it.<br><br>FYI: If you want excellent service ask for Melissa!",
