"rating":"3.5",
"reviewcomment":"The infamous Al&#39;s Italian Beef.<br><br>If you don&#39;t know, now you know. A piece of bread able to withstand a mound full of beef soaked in it&#39;s own beef juices, topped off with hot or sweet peppers to cut through the fat, and the whole sandwich is literally &#34;dipped&#34; into the au jus (if you order it this way - I recommend you do). If you like anything related to a French dip sandwich, this place will blow your mind. And taste buds.<br><br>Obviously Man v. Food brought me here, but the history of Chicago&#39;s Italian beef speaks for itself. There&#39;s no doubt that this staple is the forefront of this city. Surprisingly the bread does not get soggy - just make sure to eat the masterpiece immediately.<br><br>Make sure to stop by Mario&#39;s Italian lemonade right across the street for a refreshing dessert. A meal for a beast and dessert for a sweet tooth - all on a budget.",
