"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/fbETJ3YxZWziuLk1UoJfvA/l.jpg",
"rating":"4.0",
"reviewcomment":"This is one of my favorite Indian restaurants in Illinois.  <br><br>Though it is pricier than other Indian restaurants, even for vegetarian dishes, the flavors are amazing. My favorite dishes are the saag, saag paneer, and their dal makhani.  The dal has chunks of ginger and other ingredients, which creates a really bold flavor.  <br><br>I got take out from here and after not having Jaipur for a few months, I was VERY impressed with the flavors.  I would say Jaipur and Rangoli, which I have also reviewed, are wonderful; it just depends whether you want BYOB (Rangoli) or a nicer ambience (Jaipur).  The food is rich so I tell them no cream, and even with the modification, the food is solo perfectly flavored (and slightly healthier). <br><br>Overall, it is a bit pricey, but I will keep coming back.",
