"rating":"3.5",
"reviewcomment":"First let me say that I like this place but I wasn&#39;t wowed. I&#39;m torn between 3 and 4 stars and I rounded up. My wife and I stopped by for dinner on Friday night after work and it was an enjoyable experience, however, it was not remarkable. FYI, it was 6:45 on Friday night and we had a reservation, but it was unnecessary. <br><br>I had the BLT with the potato and leek soup and my wife had the chicken thigh. The BLT was solid and the soup was average. My wife&#39;s chicken thigh was superb, I would highly recommend it. We had the &#34;wild&#34; beer flight which was a mix of sours and lambics. The entire draft selection was in this category of very unique stuff, I&#39;m not sure I had tasted a quarter of the beers on draft which is extremely unusual. <br><br>The only downside was that there were not a lot of &#34;normal&#34; beers on tap which I believe was only temporary for a tasting event they had this week.<br><br>Overall good experience, the kitchen is open pretty late so probably one of your better options for late night food and drinks on Division.",
