"rating":"4.5",
"reviewcomment":"Scofflaw might be the best no wait option for brunch in Brogan Square. With the long lines in front of Lula and Revolution, or if you are just sick of going to brunch at Longman for the 99th time, try Scofflaw. They open at noon on the weekends and there is NO wait. At all. <br><br>Same cocktails and regular menu with a couple brunchier food items and cocktails in addition. So you can get your eggs and potatoes and mimosas if you want, or you can stick to their amazing burger or try some of the more adventurous entrees like the arancini with squid ink. And at $8 for all entrees, super inexpensive. <br><br>Service has consistently been amazing at Scofflaw from the day they opened until today. Really, some of the best service of all time in Brogan Square. Your certificate is in route to you via pedicab.  <br><br>Bro Factor: A 2 on a scale of one to five. Most of the bros who come here are on a date and therefore on their best behavior.<br><br>Bro name: Ska-Flaw",
