"rating":"4.0",
"reviewcomment":"I remember the great old days when Tiny Lounge was on Addison... and was thrilled when I heard it was set to re-open. I&#39;ve also waited a solid 5 years to write my review, mainly because I didn&#39;t want anyone else to know about this &#34;secret&#34; spot. But since they finally decided to put a sign up outside, I guess I cannot wait any longer. <br><br>The short version: this place is fantastic. Even better than before because you can eat food. Tiny Lounge does a fantastic job of bringing together some delicious drinks with some great &#34;fancy&#34; bar food. <br><br>Do yourself a favor and bring a first (or second, third, etc..) date here - and she&#39;ll always be impressed with the spot. And most likely will not have heard of it. <br><br>The only downside - some of the great bartenders from the original Tiny Lounge that came back when it re-opened have since moved on... But the drinks are still fantastic.",
