"rating":"4.5",
"reviewcomment":"I love the concept and have been wanting to check out Inspiration Kitchens for awhile. Inspiration Kitchen&#39;s mission is to help individuals affected by poverty by providing social services such as food service training. <br><br>We arrived around 1:00pm on a Sunday. Every table was occupied! I was afraid we were not going to get seating, but luckily there was not much of wait. The host was very accommodating and our server was very attentive and friendly. <br><br>We came pretty late, so a few of the things were already off the menu.I ordered the ham, spinach and swiss omelette with greek yogurt. The omelette was delicious, not too salty. The greek yogurt, amazing! It came drizzled with this strawberry sauce on top. It almost tasted like ice cream! My friends got the french toast and really liked it as well. <br><br>I would love to check out the Garfield Park location next!",
