"reviewcomment":"The first thing that caught my attention was the atmosphere. Everything was beautiful, dim, and quiet.. Well, until we had a group sit behind us, but they weren&#39;t a bother.<br><br>I felt totally underdressed, by the way. I didn&#39;t know what I was putting myself into because my girlfriend and I were feeling spontaneous. <br><br>The food was delicious! I don&#39;t know what it was called, but it was goood. We did have an appetizer beforehand, the bruschetta. I didn&#39;t expect the appetizer to be much, but when it arrived it popped and looked pretty fancy. <br><br>I did forget to mention that while being &#34;spontaneous&#34; we didn&#39;t know the average price for each plate; not very cheap, so we shared a plate. Forgive us. <br><br>I loved the waiter. He was informative and polite. He looked clean and straight. Too fancy!<br><br>I&#39;m totally coming back dressed better than casual and ready for the prices.",
