"reviewcomment":"This is one of my go-to restaurants when I&#39;m in Chicago. My first visit was a couple years ago, thanks to Yelp. I&#39;ve visited several times now, and I&#39;ve never been disappointed, despite never having had the pizza. I think my favorite part is the creativity of the drink menu. I&#39;ve stayed for HOURS here and never had a problem with service or feeling rushed. In fact, I&#39;ve met friends for appetizers and segued into dinner, totaling 4 hours in the place, with no problem. The wait staff have always been congenial and expedient. In fact, I left a post card for my roommate on my first trip and someone made sure it got posted, so it made it home a day after I did. <br><br>I have nothing but fond things to say about Exchequer. And I stand behind my 2-year old tip that the tiramisu martini is great, if you&#39;re able to get it.",
