"rating":"3.0",
"reviewcomment":"I&#39;ve been to Pint 5 or 6 times and always find myself having a good time there. The drinks are relatively cheap compared to other bars in the neighborhood, and the food is pretty standard. Lots of food options, even as a vegetarian.<br><br>The service can be a little hit or miss (for which I deducted one star), but that&#39;s bound to happen in crowded bars in trendy neighborhoods on the weekends. It&#39;s hard for those ladies to keep up sometimes!<br><br>The complaint that I&#39;ve seen in a lot of these reviews is the small size of the balcony, which I&#39;ll grant. But that being said, there&#39;s so much seating and standing room in the whole rest of the bar that that really isn&#39;t a huge factor. The bar is easy to get to and the bathrooms are pretty centrally located. There are TVs throughout so you can catch whatever game you&#39;re looking to see.<br><br>Overall it&#39;s a pretty good place if you&#39;re not looking for anything too fancy. Good food, good drinks, mostly good service.",
