"reviewcomment":"I have been here numerous times for trivia nights. <br><br>Trivia is held in the back, which is a bigger, well-lit room, with lots of seating.  Trivia nights are always a lot of fun, and the quizmaster who runs it is a lot of fun.<br><br>The bar has a good drink selection, and they also usually have a few ciders on offer (which is nice for me), and I think every time we&#39;ve been there they&#39;ve had a drink or two on special.<br><br>I&#39;m vegetarian, so my food options there are a little more limited.  If you&#39;re a fan of soft pretzels, they&#39;re great.  They often have some really great deserts.  The couple times I&#39;ve ordered side dish items, they&#39;ve been ok, but a little lacking (a bit bland or unseasoned) but not bad.  Some of my other teammates order entrees pretty much every time we go there for trivia nights, and seem to enjoy it (if clean plates are any indication!)<br><br>I definitely recommend checking them out on a Tuesday night, if you&#39;re a fan of trivia and in the neighborhood on a Tuesday night--of course, we&#39;re going to beat you, though ;)",
