"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/iDRYj3HPgWQiny0T46428g/l.jpg",
"rating":"3.5",
"reviewcomment":"Place was getting busy on Saturday evening but luckily we snagged a seat outside, as there were reserved parties inside. We were seated and were told that our waiter would be with us shortly. It took awhile and my bf and I were going to wait another 2 minutes before we just got up and left. Our waiter did come and he executed great service from that point on. He asked if this was our first time there and since it was, he explained the menu and some of their items.<br><br>We got the jerk ribs (4 pieces) to start and they were to die for. Perfect spices with a kick and meaty falling off the bones ribs. Must try.<br><br>I had the jerk chicken and I was very satisfied. The half was only $2 more than the quarter chicken, which was what I opted for. Again, perfectly jerk seasoned and chicken was very moist and tender. The plantains were perfectly lightly fried and delicious. I wasn&#39;t impressed with the rice and beans, but not the end of the world. The accompanied hard bread with sauce was also splendid. My bf got the beef stew and while not bad, he agreed that there are definite other winners at this place.<br><br>We mentioned to our waiter that we were in a hurry and he was very helpful and prompt in serving us. A little pricy but definitely coming back to get my jerk chicken fix. Also nice that they have a good vegetarian section.",
