"reviewcomment":"Their sushi is great, flavorful and fresh. The customer service is nice and they put care into the food and packaging, too (if you get delivery).<br><br>I have eaten here three days in a row. I ate the spicy tuna maki, sweet potato tempura maki and thai tea. I love thai tea and the one here is perfect. I just love the food here. The waiters are okay (sitting around, talking in Chinese about some useless matter and when you motion them for help they act like you were interrupting such an important conversation; and another one didn&#39;t give me my change), but I guess I can overlook that because the food is so good.<br><br>When I ordered my food for takeout, the sushi was packaged below the soy sauce which was in little cups in a tied plastic wrap. The thai tea was put in a rice box so that it wouldn&#39;t spill. I will eat here again. The location is also nice, you can people watch if you get close to the window.",
