"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/LOOepMa4-1olmqC_GMMbqA/l.jpg",
"rating":"4.0",
"reviewcomment":"Out of all the restaurants that I know of in downtown and the loop- the Russian Tea Time is what I would consider the best date restaurant- ever.  It is a world of difference between stepping from busy Chicago sidewalks and into Russian Tea Time.  It is a romantic shelter in a literal storm of the Windy City.  <br><br>To me, this is an easy jaunt towards or from the Art Inst.  <br>Menu that I suggest:<br>Raisin Scones with homemade whipping cream and marmalade<br>Pozharski croquette mini sandwich, honey mustard sauce<br>Potato piroshky bite<br>White Peony<br>&#34;Bai Mudan.&#34; Non-rolled, brown leaves and down covered buds yield a light yellow liquor and subtle, characteristically nutty flavor...<br>It is way different from what I would be able to cook and more importantly - I would be able to talk and say something favorable about the true taste and richness.  I know lower class Russians do not eat like this but it is what it is... It is here in an upscale version and I take full advantage of great restaurants like this whenever I have the chance.   <br><br>Great to share for a small bite or a full out meal and then order a great entrée.  Easy to share, wonderful  to feel a moment together.  <br><br>On dates- I would suggest staying away from the alcohol.  You do not want to be seen as a lightweight at a Russian bar- no sir.  <br><br>I for one would never dine here alone- I would pretend to be writing a boring spy novel of Russians meeting Russians in order to take over the 2nd largest city of Polish speaking people in the world for their own- even before all of this stuff about Crimea and Ukraine.    <br><br>Afterwards if the taste is still too strong for you. Don&#39;t just go out for the next meal at McD.  Go for a nice hot black coffee- no starbucks frill drink, just a black maybe strong Kona coffee to clean and cleanse your pallet.  2 reasons- A coffee will keep the date going strong and upbeat if the date is going well- and B  another reason to going to another restaurant later on the date.<br><br>I will continue to fondly remember this place and hope to visit soon again because of fond memories.",
