"reviewcomment":"Came here for brunch and had a amazing experience. We were seated downstairs which has a very cool vibe (sports on TVs, good music playing, and great decor). <br><br>We were able to be seated pretty quickly despite the amount of people that showed up around the time we walked in. <br><br>The food was absolutely delicious. Very big portion sizes so splitting would be a great option. I got the hashes (chicken, asparagus, two eggs, etc). The potatoes in it were so good and the chicken had so much flavor. It came in a big skillet like pan which had great presentation. Everyone else at the table that ordered something did not have one complaint about their food. <br><br>We also tried their bloody Mary&#39;s. They were just the right kind of spicy (I like spicy bloody Mary&#39;s so if too much bothers you, you might not enjoy them). They came with olives stuffed with jalapeños as well as sweet pickle, and a green bean. <br><br>I highly recommend this place!",
