"reviewcomment":"I came here on a Saturday afternoon not really knowing what to expect. I randomly found out about this place on Yelp, and I was in the area so I decided to give it a try. I loved the feel of the place! The music was awesome, lots of bright colors to make it festive, and the hostess was very friendly!<br><br>As I started to look through the menu I was a little nervous because I&#39;m used to taquerias where everything is $5-10, but I said whatever and just hoped for the best. We were immediately given tortilla chips and salsa. Instead of jalapeños and carrots they give habanero peppers and onions. I was not prepared! Haha. The peppers were fiery hot, but nonetheless good. <br><br>After searching for a little while I decided to order the  &#34;Combinacion Puebla&#34; and &#34;Tamalitos&#34; for an appetizer. One word.....AMAZING!!!! The food was awesomely delicious. The mole tasted authentic and the Chile relleno was excellent! The tamales weren&#39;t dry, and everything meshed together perfectly. The wait staff was very attentive and helpful. Spanish isn&#39;t necessary but it&#39;s always fun to use! I&#39;ll definitely be back",
