"reviewcomment":"Everything about North Pond is done well, done right, and consistently, continually delights.<br><br> Delectable foods expertly prepared with mainly seasonal, local ingredients and so an ever changing menu.<br><br> Very attentive service by knowledgeable professionals who seem honestly to enjoy what they do. <br><br> Excellent wine and fun specialty drink selection. Their top shelf booze is indeed that.<br><br> They personalize your menu and profer special treats for private holidays like birthdays and anniversaries and are a uniquely fulfilling special occasion location.<br><br> Their eye for aesthetics is admirable, both in their platings and physical surroundings. Extremely well designed and executed, warmly heavy on wood and stone Craftsman inspired interiors and exterior. Some stunning views of the nearby north pond and the Chicago downtown skyline. It&#39;s a great area for outdoor wandering before and after one&#39;s meal, ideally with one&#39;s sweetie.<br><br> Very likely our favourite restaurant in the world. <br><br>Most sincerely,<br><br>Peter O. and S.",
