"rating":"4.0",
"reviewcomment":"I came here today with a friend who was visiting Chicago, and I was just blown away by how delicious the food was! The ambience and atmosphere was great--perfect for catching up with your girlfriend/sharing an intimate meal with your date. It was a nice, cosy place that wasn&#39;t too loud, but at the same time not deathly quiet.<br>We ordered the fried stuffed avocado with spicy tuna etc. and it WAS NOTHING SHORT OF AMAZING. The spicy, soft tuna complemented the crispy texture of the fried avocado really, really well. <br>Aside from that we also ordered Ocean Drive sushi--it was literally a platter of different kinds of seafood sushi rolls (like a drive...) and it was sublime. One reservation I have about this dish, though, is that the rolls were slightly too large and were a mouthful to chew on.<br>Waiters were friendly, attentive, and our orders arrived quickly.<br><br>All in all a satisfying experience!",
