"reviewcomment":"I wanted a quiet evening with my wife over fine food and cocktails...this place delivered!<br><br>Our server was attentive and very familiar with the menu, cocktails, and the near-by bar scene. He gets a 5/5. His cocktail creations/suggestions really hit the spot!<br><br>Appetizer: Garlic bread: 5/5, the blue cheese fondue was bonkers good.<br><br>Main course: Bone In Filet Mignon 16 Oz: 5/5, I had it served as rare as possible...one of the most memorable steaks in all my travels! My wife had the porterhouse special: 5/5<br><br>Side dishes: Macaroni &amp; Cheese: 5/5, the 3 cheeses and crust were a nice compliment to my steak; Creamed Spinach: 3/5, we weren&#39;t really feeling this dish...it wasn&#39;t terrible, but didn&#39;t pop-off like the other items.<br><br>Overall a great experience for the $$ spent. Is it pricey? Sure it is...it&#39;s a steakhouse on the Magnificent Mile. I would return here for sure because the whole experience was complaint free.",
