"categorystrlist":"Coffee & Tea,         Cafes",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/8No0nBFJQQoLwZjRg1M_Gg/l.jpg",
"rating":"4.0",
"reviewcomment":"I walked in and thought &#34;wait, am I in wicker park?&#34; Then a stroller bumped into me and I realized I was in fact in Andersonville. This is not just your average coffee shop. They truly care about crafting delicious, quality drinks. Not only that, they stock some of the best pastries a coffee shop can offer. And they have doughnut vault doughnuts. OK, count me in!<br><br>The atmosphere is nice and mellow, but does tend to attract a large group of table hoarders that turn their table into their home office. It&#39;s not &#34;I brought my iMac to the coffee shop&#34; bad, but it is a bit annoying that they tend to hog much of the seating there.<br><br>Despite that, the coffee studio is by far my favorite place to sit, chat and grab a coffee. Plus it&#39;s in Andersonville! How can you beat that?",
