"rating":"4.0",
"reviewcomment":"I went to Fleming&#39;s this evening for there &#34;5 for $6 til 7&#34; happy hour. Like always they didn&#39;t disappoint. The bar area is first come first serve and you seat yourself. We sat in the back booth and let the ordering begin.What a bargain it is because the food and drinks are top notch. We ordered 6 Blueberry Lemon Drop Martini&#39;s (Yum), Cedar Roasted Mushroom and Artichoke Flatbread (Delicious), Shrimp, Brie platter, and a Bacon Burger with fries. Can you believe for the 3 of us our bill only amounted to $23 a person for all that food?!?!?<br><br>The service is excellent.Our waitress wasn&#39;t overbearing, but would check on us. The noise level is perfect and we were able to enjoy our 3 hour conversation without feeling rushed. The owner (I presume he was the owner) was great and he came over to check on us as well.This is an awesome place to catch up, share some laughs, and eat/drink wonderful food.<br><br>The only possible con is there are only about 3 TVs. I know for happy hour some people find that a big requirement to see them everywhere. Doesn&#39;t bother me one bit though. Last, but not least I gotta mention the chocolate mints they have when you come in. I have like 5 in my purse there so good.  I can&#39;t wait to come back here and try there dinner menu.",
