"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/lw9gf7fbsyNlqd5KeMRzqQ/l.jpg",
"rating":"2.0",
"reviewcomment":"Environment: 4/5<br>Employees: 5/5<br>Drinks: 5/5<br>Cost: 5/5<br>Total: 19/20<br><br>Synopsis: So for the Yelp Elite event, it was a Cupid Undie Race for people who had Neurofibromatosis (NF), a genetic disorder related to tumors along the nerves.  There are three distinct kinds, so the point of this race is to raise money and a bonus to see men in their underwears.  Let us be honest, that is why I went. Gawk at all the cock!  Originally, I was not going to go because during the first e-mail, it mentioned it was the Barleycorn on Kenzie, but when I found it out it was Wrigleyville, I wanted to shoot myself.  UGH!  But in the end it was all worth it.  Collin, our bartender, gave Beth, myself, and Morgen free drinks.  And did I mention he was adorable too?  I met these lovely couple and it just turned out to be a blast..minus the TRAGIC people whom should have stayed fully clothed...<br><br>Coming here was a special occasion. Would I come here again?  Not for Wrigleyville as it is more of a &#34;college&#34; feel...and unless everyone is going to be in their underwear like Minibar, I think you can pass, especially if you like diversity.<br><br>Environment: This place is not as nice on the one on Kenzie.  Perhaps they wanted that more &#34;dive&#34; look, but I do like the fact how the bottom is more for a drink spot whereas the top floor was more for dancing.  And it was very spacious indeed.  I did not feel claustrophobic for a second.  So much space, I was able to do spread eagles!<br><br>Employees: The bussers were very attentive and once the drinks were down, they were gone soon after.  They wanted that place to be top-notch looking.  Collin.  Cute, 24....:D  with a very nice smile.  More to that he was attentive and quick with the customers.  Two thumbs up.<br><br>Drinks: <br>Vodka Soda: More vodka, less soda..that&#39;s how I like it.  Strong!  YUM! 5/5<br>Long Island Iced Tea: More liquor than anything.  That is how I like it.  More alcohol equals more dancing!  Drop it lowww!!!! 5/5<br><br>Cost: The whole time I was there, it was only 5 bucks.  I cannot complain!  Liquor + men - clothes but undies.  Successful event!",
