"reviewcomment":"Just popping back in to say that this place still has yummy food, four years later!  We sat in the enclosed-patio again, started with the zucchini pancakes (still good) then tried some new dishes - kofte kebab and the Uskudar.  Kofte kebab was fantastic, one of the best versions of the dish I&#39;ve had.  Uskudar was really good too but involes lots of eggplant slices.  Eggplant isn&#39;t my favorite thing but I honestly didn&#39;t mind it so much here, so clearly Cafe Orchid is working some kind of magic in the kitchen.  The lamb cubes were really tender.  <br><br>I still prefer Turquoise Cafe but this is a great little neighborhood joint and the food is solid across the board.",
