"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/I28Hgmnfhf1gOBDOR-B-OQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I super love this place.<br><br>Let&#39;s start with the food. It was amazing, honestly. I had a Groupon with three other people so we tried a little bit of everything. We all shared the:<br><br>Buffalo chips: buffalo sauce, two types of cheese, and ranch dressing. What&#39;s not to love? They do come out on bbq chips- like Lay&#39;s bbq chips- so that was a little weird but it was still good. Also super huge portion.<br><br>Rib tips: I&#39;m usually not a rip tip fan but these were done very well. Everyone else agreed.<br><br>Pulled pork: this is my favorite thing here. I think it is done so well- possibly the best pulled pork I&#39;ve ever had.<br><br>Hot beef sirloin sandwich: Holy cow was this amazing. It&#39;s topped with buffalo sauce, cheddar, and onions. I don&#39;t think I&#39;ve ever seen an item like this at a bbq place and I loved it.<br><br>Sides: tater tots, coleslaw, baked beans, and roasted potatoes: All great, again. The most surprising were the roasted potatoes, actually. Wasn&#39;t plain like I expected.<br><br>Add in that it&#39;s BYOB? Awesome. Back patio? Great. I also really like the open kitchen vibe and how everything is just kind of there. The bathroom is also super clean, which is always a plus.",
