"categorystrlist":"Pizza",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Ky3FUL3_UrONt9U1a6u9hA/l.jpg",
"rating":"4.0",
"reviewcomment":"Dear Lou,<br><br>You know you&#39;ve always had a special place in my heart. Gino and Gio have nothing on you. But I just can&#39;t deny how good Pequod is at making pizza.<br><br>The crust? Unbelievably crispy thanks to the burnt crust. I know that sounds disgusting but once you&#39;ve had it, you can&#39;t stop. I wish I could get a pizza that was all crust.<br><br>The sauce? Rich and full of so much flavor. Your sauce is a little too watery and the other places don&#39;t put enough in their pizzas. But Pequod knows how to do it right.<br><br>The ingredients? All taste fresh and seasoned perfectly. The meatballs and sausages are to die for and all the veggies are portioned out into the right amount so that no one takes over the entire taste of the pizza.<br><br>I hope we can still be friends. You&#39;re a lot easier to get to than Pequod. But in my heart, you&#39;ll always be second best.<br><br>Sincerely,<br><br>Simon",
