"rating":"3.5",
"reviewcomment":"This review is mainly for baby atlas which is the &#34;club&#34; area of this bar.<br><br>Like everyone else, be weary of the steps going down to this area of the bar because they are steep.<br><br>There is a door guy that only lets x number of people in at a time.  I can understand as the bar downstairs is quite small with extremely limited seating and not a lot of room to maneuver.<br><br>Drinks are OK priced.<br><br>I give this place 4 stars because of the music played here on Saturday nights.  The DJ really knows how to transition from todays &#34;hits&#34; to the old skool stuff and back again.  Most of the music I enjoyed which is saying a lot because I am picky when it comes to where I throw down my sick moves.  The dude played JT, Usher, and Boyz II Men in the set, I mean do you even get that at any bar or club anywhere in Chicago these days??<br><br>4 stars not 5 because the clientele had a hard time feeling the music and that is always a vibe killer.  I mean they are playing Next Too Close and everybody is just standing around.  For shame.  <br><br>As for the upstairs, it is trendy, dark, and a good place to get a drink and do some mingling.",
