"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/S98EhJXhzaZb-RLeCL_zCQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I came here lured and intrigued by the dim sum Sunday brunch.<br>I have to say that this a much better dim sum than the one tried in Chinatown, which was just awful and definitely not my thing.<br>The dim sum bunch at Koi has definitely some tasty items such as the shrimp cakes and spinach wraps. The great thing that these are small bites and that you can try a lot of items on the menu. The Jasmine tea is just delicious and bottomless mimosas are great as well. <br>I think my favorite items on the dim sum menu were the sweets, they are really tasty and unique and I don&#39;t know any place that offers them.<br>The service on Sunday is little rushed, there was one waiter that really stood out, and he rolled with the dim sum cart and explained everything in great detail and what he had. The other dim sum cart driver was not that great. The waiter was kind a non- existent, I am not sure what he was doing but he was not by my table. The one dim sum cart guy was like my waiter eventhough it was obvious it was not his job. I hope that he is compensated for his hard work because he really became my server.<br>Overall, I would recommend this dim sum Sunday brunch experience it is a lot of fun and there are some great finds.....its like a dim sum scavenger hunt.",
