"reviewcomment":"After being sick for a week, I was STARVING. I had been to the Elly&#39;s location in Norridge before and remembered good things about it so I thought it would be a good place to satisfy my hunger.<br>The food- I had a build your own skillet (chorizo, chihuahua cheese, avocado and sour cream), the portions were HUGE(took half of it to-go). The pancakes were <a href='/redir?url=http%3A%2F%2Fbomb.com&amp;s=bb4f996415a9c2f21137e27cfb68f439a48cec2652b53e9b50dd7e766dbe177e' target='_blank' rel='nofollow'>bomb.com</a>, I scarfed those bad boys down in about 2 mins. The orange juice was delicious. The hash browns in my skillet could have been cooked a little longer.<br>The service- Service is a huge thing for me, the slightest mistake/hint of attitude really ruins the whole visit for me. Our server was good at first, was a little rude during the time he took our orders because midway he stopped and turned to other guests.. never came back during our meal until we were done,(although, maybe he saw me demolish the pancakes and thought she is not one to be bothered..) the seating is a bit weird. I practically had my butt in an elderly lady&#39;s face to get to my seat.<br>Basically, food is great. Service is.. meh.",
