"reviewcomment":"Been here a good handful of times since they open. <br>Small plates, the bill adds up. Easily 6-8 dishes per person. <br>Our last visit was in April for my husband&#39;s birthday. Specifically mentioned on reservation and confirmed on the phone that we would like a dessert or something. Nothing was done or mentioned. We were in a hurry to go, didn&#39;t care to ask, but a little disappointed. <br><br>Food is always good. Skip the beef tongue or heart, forgot what it was, soso. <br>The steak wrapped in seaweed was always good. Had it twice, still on menu. <br>The smoked quail eggs on some kind of greens is very refreshing. Even took it to go. <br>Chicken skin, gobo, boneless chicken wing, cold soba, oysters raw or cooked, tako yaki w whatever inside, ... All good. <br><br>Sosos are the beef tongue or beef heart, the fried chicken, ramen w the pig tail meat<br><br>If you can climb onto those bar stool, it&#39;s a good seat to watch them work.",
