"reviewcomment":"This place is pretty good. I got the Tirokafteri  (red hot peppers blended with fet cheese) and the Garides Scharas (Five char-grilled jumbo shrimp marinated in olive oil). The Tirokafteri was alright. It wasn&#39;t what I was expecting. It looked like ice cream, but it was a spread that you put on bread (definitely get the pita). It was pretty good nonetheless, just very rich and hearty. The shrimp was great! I loved it! It was cooked to perfection. I didn&#39;t get the rice that comes with it, so I got a side of green beans instead (which were your typical cooked beans). I think I would get the potatoes next time.  <br><br>I would come back for the atmosphere and the entrees. The staff was friendly. Maybe too friendly since they would come over and check every 5 minutes, but that was fine. :-) They were nice. The setting is very great for a casual night out/date/outing with friends. I felt as though I entered a different country. <br><br>I would come back.",
