"rating":"3.5",
"reviewcomment":"Not as fancy of an establishment as Smoque and Honky Tonk or whatnot...but what it is is just straight up good bbq.  There aren&#39;t a million sauces, just one. This place doesn&#39;t get ahead of itself.<br><br>So far I&#39;ve smashed an extra large ribtip combo and put it to rest with a friend. Its a generous size with tips, links, fries, and bread. Specifically enough to feed about 4 people but there&#39;s no judging on Yelp. All of it was damn good including the cole slaw and baked beans we had as extras. I&#39;ve looked for a go to bbq joint in the city for a while and it&#39;s safe to say I found it. The menu will be cruised through real soon.<br><br>Truth is is that this place is pretty divey looking and thats definitely not a make or break with me because thats usually where some good food comes from. But some more truth is that the workers are pretty unprofessional. There was literally a shouting match between the workers and no attentiveness. They were also pretty much running out of everything on a Friday night, 7pm. The wait on a rack was 45 min. <br><br>My advice would be to call in no matter if you want to dine-in or not.",
