"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/KCfFm_u16GRggtUvROzuNQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Yen is a cute! I thought it would be diner-y but its not. It&#39;s a legit little restaurant with great service. The food was pretty authentic too, but you have to ask for it, say that you want it drier, or smokier, and the chef is happy to oblige. The lady who handled our table was extremely friendly and very helpful, when they didn&#39;t have dessert, they offered us almond cookies for free instead as well as kept the green tea going. <br><br>We had the Yen&#39;s garlic beef, the crab Rangoon and the moo shu chicken. I wasn&#39;t a fan of the plum sauce that comes with the chicken, but everything else was really good. We also tried the healthy chicken stir fry and that was amazing. We asked for the beef to be made Mongolian style- more dry and smoky- nad they were happy to oblige. The lady even made our wraps for us at the table- super nice of her! Everything was well seasoned and flavored. And 30 bucks for 3 people (no booze) is a steal. Thanks Yen, I&#39;ll be back!",
