"reviewcomment":"My neighborhood Thai joint and the best Tofu Panang Curry in the game. The noodle dishes are on point too partcularly the Tofu Pad See Ew.  This place is the business, my compliments to the chef and the kitchen and the nice friendly folks that run the place. The are also consistently good like the food quality doesnt fall off... to be fair I dont change up my order too much.<br><br>I mean I&#39;ve tried Panang Curry from other places when i&#39;m like... too lazy to get up and go across the street and I want something delivered, but i&#39;m too embaressed to have someone deliver food across the street so i try another places Tofu panang and it&#39;s soupy, not the perfectly balanced spicy&#39;savory/sweet like at Spoon Thai, the tofu isnt awesome and delicious like at Spoon Thai...they dont have the awesome vegetables and special touches with presentation that Spoon Thai has..... I think I had one other place ever that did this dish ALMOST as good as Spoon Thai but it still wasnt as good as Spoon Thai and also I forget which place it was. So. That place is dead to me. <br><br>If you&#39;re looking for a good Panang give this place a shot. The Red and Yellow curries are also delicious. The tofu is done right here and tastes really yummy and not gross. I love Spoon Thai. Very good crab rangoon here too. So if like me you want this sort of fair give Spoon Thai a shot they are better than everyone else.",
