"rating":"3.5",
"reviewcomment":"This has to be my favorite restaurant in the area. The portions are huge, the prices are more than fair (they always have coupons on Groupon, <a href='/redir?url=http%3A%2F%2FRestaurant.com&amp;s=0aab4cbd731f3d3b0d1453050d3abc56a8c80bd214e25469c7555b750dca8a51' target='_blank' rel='nofollow'>Restaurant.com</a>, etc!), the food is better than great, and the ambiance is the most comforting blend of classy-casual around.<br><br>The fried chicken is the best I&#39;ve ever had. And I&#39;m from the South, y&#39;all! :-) They have live jazz some nights, and there is often a long line. Weeknights and Saturday morning brunch usually means that you can walk in and take a seat right away.<br><br>Get the Saint your first time and then branch out from there. Everything is wonderful (except the biscuit - do not order the biscuit), but you have to start with the classic. The dinner options are great and the red beans and rice is SO wonderful. <br><br>I have taken dozens of friends here when they come to visit, and everyone loves it and agrees that it is some of the best food they have ever had. Please go, and enjoy!<br><br>P.S. They also deliver, but I think you need to go in your first time. The atmosphere is cool and the food tastes considerably better fresh.",
