"reviewcomment":"Uru swati is awesome. All I can say is, all of the food is very south indian/hyderabad style, and very different than traditional indian cuisine. You&#39;ll notice the different spelling and style, but the food very much speaks for itself.  Do go here, whether you are a vegetarian or not. The food is excellent and does have spice.<br><br>Details wise: the Bhindi (Okra) Massala was awesome, and had a great spice kick to it. I also suggest getting a chaat, as those are very unique. Anyone who hasn&#39;t had that style of indian cuisine will likely enjoy that. Also the naan is excellent, although I couldn&#39;t detect much of a kick in the spicy naan that was offered.<br><br>It&#39;s also really busy and space is a bit crammed, so that may take away from the experience a little. It is however BYOB, which is excellent.",
