"rating":"4.0",
"reviewcomment":"I&#39;ve lived in the area for a few years and decided to finally check the place out since there was a Groupon for it. Agami looked like it would be an expensive place, so I&#39;ve always avoided it. The interior was really nice. I was actually surprised at how nice and spacious it was...it seems like a restaurant you&#39;d find downtown. My dining partner and I were seated at a booth in front of the sushi bar and noise levels were at a minimum. <br><br>We ordered a shrimp shumai appetizer and 4 rolls. The shrimp shumai was decent, but 4 shumais for $7 is kind of ridiculous. You&#39;ll get better tasting ones for almost half the price at Furama. The sushi rolls were pretty good, but again on the pricey side...good thing we had that Groupon! What was a bit annoying was the amount of ginger and wasabi that came with the rolls, it seemed like they were there for decorative purposes. We asked for more and the waitress came back with generous portions. <br><br>Overall a good experience, but I&#39;m still thinking if I would come back without a Groupon.",
