"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/-BMCY7lS6LipBo5BJG3K_w/l.jpg",
"rating":"4.0",
"reviewcomment":"It was expensive, but the food was excellent. <br><br>The gimmick is the Mike&#39;s Special. Tell your server some ingredients that you like and  don&#39;t like, and Mike will whip up (an allegedly) one-of-a-kind maki for your table with some unusual ingredients. We went for this option and were served a generously sized smoky, salty roll with shiitake mushrooms, avocado, white tuna and truffle oil. Pretty cool and definitely unique. <br><br>We also ordered some nigiri, which is where I feel like Mike really justified his fairly steep prices. The fish was excellent and (in addition to all of the standards) they had my favorites: raw scallop and uni. Both were awesome and were pretty generous servings. <br><br>It&#39;s BYOB and street parking is available on the block.<br><br>I&#39;m adding &#34;eat at Tanoshii all the time&#34; to my list of &#34;things to do when I have more money.&#34; (My favorite thing to daydream about).",
