"reviewcomment":"Loved the food. Totally nonplussed that it&#39;s closing to give way to a middle tier Italian restaurant. I got the explanation and I understand it, but that doesn&#39;t mean I have to like it.<br><br>But on to the review. A great friend and I had our own mini degustation with wine pairings that was simply outstanding. As my friend and I have discovered, trusting the server to come up with the menu and the wine pairing creates a winning meal every time.<br><br>Homemade bread. Diver scallops. Escargot bourgogne. Split pea soup. Duck cassoulet. Nettle Ravioli. Cafe au lait. Banana souffle. Three tier chocolate mousse.<br><br>One of my greatest French dining experiences in Chicago was at a certain French restaurant in Evanston. After going ot Henri, that Evanston restaurant had competition. It&#39;s too bad that Henri will be closing its doors.",
