"rating":"3.5",
"reviewcomment":"We just had Connie&#39;s cater our wedding on May 16, 2014 at the Wilder Mansion in Elmhurst. It was amazing! The table cloths were beautiful, the food was so good and best of all the Connie&#39;s catering staff knocked it out of the park! Julio was a dream to work with! He was so attentive to all of our questions, needs and requests!!<br><br>Food:  We had filet mignon with red wine reduction, lasagna, potatoes and vegetables. The hors d&#39;oeuvres were caprese skewers and lampchop lollipops. Everything tasted fresh and wonderful. I loved the filet especially.<br><br>Service: Amazing! Julio brought my plate to the table so I wouldn&#39;t get it on my dress and then were able to mingle more with our guests. The servers were more than attentive and so polite. Everything was magnificent!<br><br>Bar: The bar was great! I heard nothing but wonderful things about the service. <br><br>Everyone at my wedding was so impressed and I am a long time customer. I used to go to Connie&#39;s on Archer as a kid and will continue to go and enjoy the pizza! I will  use Connie&#39;s catering again! Thank you so much again for making our day!",
