"rating":"3.5",
"reviewcomment":"What a gem! A solid brunch spot with an abundance of choices, you honestly can&#39;t go wrong. Bring your vegetarian friends! Bring your vegan friends! Bring your hungover friends! Bring your kids! This place accommodates all. <br><br>The place is always packed when I go for brunch on the weekends, yet somehow they manage to seat me within 15 minutes of walking in each time I&#39;ve gone.  So far, I&#39;ve had The Lady Marmalade, Pollo Loco, and their steak omelette. Everything was wonderful, but I think they do Mexican breakfast items particularly well. Their house potatoes are exploding with flavor and taste great alone or accompanying any item on the menu. <br><br>Service was friendly and prompt. They look like they are having a good time, and that&#39;s always fun to see. <br><br>Honestly, the only problem is that everything sounds good and it is much too hard to choose only one item. The only way to solve this problem is for me to go back until I&#39;ve tried everything! Challenge happily accepted.",
