"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/2wXg1NDUX_hiLAMTf_6JuQ/l.jpg",
"rating":"4.0",
"reviewcomment":"My boyfriend and I came to Cooper&#39;s last Sunday to grab a bite to eat with another couple.  I wasn&#39;t super excited since I was tired and not the biggest BBQ fan, but this place suprised me in a good way.<br><br>We were only one of 3 tables seated, and the place was very cute and relaxed.  I didn&#39;t even realize that we stayed a little past closing since nobody rushed or pressured us; it wasn&#39;t until they turned off the lights after we walked out that I realized and felt bad.  Great service overall.<br><br>The beer list was absolutely huge.  They have Alpha King which is one of my personal faves.  Having been to a Cubs game earlier in the day, my boyfriend and I weren&#39;t starving so we shared the Pesto Chicken Panini with a side salad (yes, I got salad on his plate and he actually ate it).  The panini wasn&#39;t what I was expecting and was actually like Chicken Salad with pesto instead of (or in additional to) mayo.  It was so delicious.  I would definitely get it again, but am also wanting to try other menu items including the disco fries &amp; pizza.<br><br>This isn&#39;t exaclty in my neighborhood, but with easy street parking on Belmont, I will deifnitely be back.  If my second expierence is as good as the first, I can definitely forsee an increase to a 5 star rating!",
