"rating":"3.0",
"reviewcomment":"During my 5-night stay at theWit, I ate at State &amp; Lake for several meals.  My experiences there include a good mix of time frames and busyness, so I feel pretty comfortable in saying that I have a good reading of the place overall.  I enjoyed each meal and had wonderful service as well.  Two of my favorite dishes are the chicken &amp; waffles and butcher burger w/ fries.  <br><br>A couple servers who stand out are Paige and Luiz (sp?).  They were very friendly and attentive.  The manager was genuinely welcoming and was very attentive to the servers as well as guests.  One morning, I witnessed a patron approach the manager with a (ridiculous) complaint/suggestion and he handled it very professionally.  I was cringing inwardly at what the patron was saying; but the manager did a great job at listening and then appeasing him.  I&#39;ve never worked in the food service industry, but I definitely appreciate the hard work that these people put in.  <br><br>Whether you&#39;re a guest at theWit or not, I highly recommend you visit State &amp; Lake.<br><br>TL;DR Great food / Excellent staff.  Go there.",
