"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/_dhvWmDbNylSBiebDzH3qA/l.jpg",
"rating":"4.0",
"reviewcomment":"I remember when I was a kid and there were a few mom and pop places in the Loop. They are mainly gone. That is sad as you know what you are getting at Jmmy John&#39;s, but it means a lack of diversity in food. I mean how can there be that many Subways in the Loop? <br><br>That said, this has become my favorite place to eat in the Loop. I mean I love this place! I have never had anything that I did not like. <br><br>I am very big on the Shish ka bab sandwich now. I prefer the lamb. It is not made in advance, there is about a 7 minute wait. Isn&#39;t it great to wait for something that is being made and not microwaved! Okay, I have had it with the tomatoes and cucumbers which is great, but one day they put roasted peppers on it and it was just incredible!<br><br>I just noticed they have sugar free Baclava, can that even exist?<br><br>Seriously, it&#39;s less than eating at the wretched Panda Express or Mc Donalds and I suspect this may even be healthy!",
