"categorystrlist":"Seafood,         Cajun/Creole,         Bars",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/2o6vHc7oX0pD26_i63lkEg/l.jpg",
"rating":"3.5",
"reviewcomment":"I can imagine this bar not being everyone&#39;s cup of tea (or pint of ale perhaps), but it did it for me. <br><br>It&#39;s a bit of a metal bar, so if you&#39;re not into loud, aggressive music while you drink excellent beer, this place may not be for you. If you are OK with that, the place is a gold mine for the beer lover with a great tap selection and an expertly curated and properly stored bottle list that will have something for all tastes in beer. Well, perhaps excepting Bud Light drinkers. :)<br><br>The staff are knowledgable and really enjoy talking beer and metal. We were well looked after and had a great time. I can&#39;t comment on the food as their kitchen was closed, but I was only there for the beers anyway!<br><br>My only criticism is that they put all the tap beers on a blackboard as you walk in, and there are no printed beer lists for the tap selection. This is easily solved by snapping a quick photo as you pass the board. Voila! Instant beer list. :)<br><br>Check the place out for sure.",
