"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/LksZayazIEiqVeu-F7L_XQ/l.jpg",
"rating":"3.5",
"reviewcomment":"FT for a while now has been a go- to favorite of mine. I&#39;ve turned people onto it and they&#39;ve been just as happy too. Fresh fruits and veggies, meats, rice and noodles and all the little extras to bring your bowl to life just the way you want it. <br><br>The bar is stocked with some good beers and drinks even though I stick to water and fountain drinks usually through dinner. <br><br>The one thing I can recommend is the chocolate storm dessert. It&#39;s your well known hot brownie and ice cream but I love it even though I&#39;m not the biggest sweet tooth person. <br><br>FT is a dining experience overall. Good for first dates I would say since its interactive and can be playful. Fairly priced and AYCE is the cherry on the top. <br><br>I would&#39;ve given out 5 stars had I not tried breakfast. It is good but I&#39;m more of a traditional breakfast diner. I associate FT with Asian flavored cuisine but just wanted to try the morning experience and it just didn&#39;t fare the same. But still a go to staple on those nights where everyones food choice is &#34;I don&#39;t know&#34;.",
