"rating":"3.5",
"reviewcomment":"Did not have high expectations for Furama dim sum but was delightfully surprised by the food and overall experience! <br><br>We went on a Saturday around 5pm for dim sum, since its served pretty much all day on the weekends. I was skeptical about the freshness of the dim sum since it was after the lunch rush, but all the dishes came out fresh and great! Also, flavors were delicious as well. <br><br>I loved the: shrimp toast, har gow (shrimp dumplings), quail egg shu mai (never seen that before), chicken feet, turnip, turnip cake, beef tripe, shrimp rice rolls, and egg custard. We also ordered pork pan fried lo mien and that was great as well. They have a side menu of noodle dishes and I think Vietnamese dishes too. <br><br>Service was prompt/friendly and the free parking is definitely an added plus. I will definitely be returning for dim sum instead of trekking down to Chinatown! Great place to take friends/fam too.",
