"categorystrlist":"American (New),         Italian,         Salad",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/qvKeCoM3BpPTWTs_5cPAMg/l.jpg",
"rating":"3.5",
"reviewcomment":"This was my 4th dinner restaurant stop as one of our colleagues was staying at the Hyatt connected to the McCormick.  This place was in relatively close walking distance so we gave it a shot!....I loved it!<br><br>It was pretty packed for a Monday evening and the sound level wasn&#39;t too bad.  I loved the bread they first brought with the marinara dipping sauce.  I got a nice glass of Montepulciano with my meal - yum!  I had to get the baby clams with linguine as this is my go-to dish if I see it on the menu, and I wanted to compare it to others I&#39;ve had.  YUM!  Baby clams were piled high and the pasta was cooked perfect al dente - love the garlic, mmm mmm!  <br><br>I had a lot leftover so I took it back to my hotel, and had it for breakfast the next morning - unusual, I know, but I loved it!  And the garlic flavor is even better overnight!  <br><br>Service was so friendly and attentive, and since we were visiting, the hostess gave us a list of her favorite Chicago spots to visit.  Sweet!  Grazie, Cafe Bionda, I will be back!",
