"rating":"3.5",
"reviewcomment":"A cute little pink house that serves a terrific breakfast with friendly service and even friendlier patrons?  Why yes.  Find me a seat!<br><br>I stopped by on a busy Saturday morning and this place was hopping!  But no problem as they pointed me toward a seat at the small counter in the back.  I quickly had a great tasting mug of coffee in my hand and ordered my favorite omelet with some jalapeño bacon on the side suggested by my friendly server.  They have a full bar so have one of their bloody Mary&#39;s and you won&#39;t be disappointed!<br><br>My food came up quickly and was very good.  My coffee cup was never empty and as for that jalapeño bacon?  Sign me up, I&#39;m a fan!<br><br>But what I liked the best is the friendly atmosphere of the place.  An older man invited me to eat with him, a table of guys bid me hello, the woman next to me talked about the book she was reading and this was all in one visit!  I think this stems from the friendliness of the owners who also stopped by to say hi!<br><br>Street parking is a breeze and there is even outside seating for those nice weather days.<br><br>I love breakfast out and this place lives up to its name!  It&#39;s like a club where everyone else who&#39;s there loves it too!!",
