"reviewcomment":"I don&#39;t live near Edgewater but I will make the trip that way for Nookies! <br>I went for lunch with a friend if mine and her 3 daughters. Not only was the service quick and friendly, but very attentive to the children as well. She made sure the kids got the food so my friend and I could talk. <br>I am not usually a fan of &#34;pea anything&#34; but their split pea soup changed my mind! It was so delicious I could of had a second cup but I had also ordered a pulled pork sandwich with sweet potato fries. All of which is to die for!! The fries were cooked perfectly!! And the sandwich had the right amount of BBQ sauce so I could still eat the sandwich whole and not make a total mess of myself.<br>I haven&#39;t had the opportunity to go down for brunch yet, but I have only heard good things and can&#39;t wait to make the trip!!<br>Make sure of you get a chance to get down to Edgewater you definitely need to hit Nookies for a meal!!!",
