"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/zj8pZMue2qK-4un3Zt6IMQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I had lunch here couple days ago and I&#39;m on my way to pick up dinner because I&#39;m craving their food. Think of it as an explosion of flavors in your mouth. Everything can be extreme (salty, tangy, sweet), but it works so well in your mouth you want to keep eating. <br><br>Ask for the Thai special menus if you are adventurous, we often just order on that menus since I can get other stuff somewhere else. Our favorites are the tripe salad (not on menu it&#39;s a special that is taped on a wall there), thai bamboo with ground meat (not the curry, but the one on the special menu), and the Phrik King with crispy pork. The larb is delicious as well, and if they ask how spicy I&#39;d advise to say mild. I&#39;m pretty decent with spicy food and I&#39;m pretty sure by the end of the meal my tongue was a little numb. <br><br>Service has been good, very nice servers. The place is simple and clean. And if you walk into an ethnic restaurant seeing an older woman with a hair net playing on an iPad, you know you&#39;re at the right place.",
