"rating":"4.0",
"reviewcomment":"I have ordered Pho from just about every single Vietnamese restaurant on or around Argyle.  Over time and through experience, Hai Yen has my favorite broth.  It tastes more flavorful and concentrated than most other places on the block.  All of the noodles and veggies that come with the broth are extremely fresh.  This is also one of the few broths that I add very little extra sauce to because it doesn&#39;t need help.  <br><br>The inside of the restaurant feels a bit more upscale than the some of the other places on the block.  Hai Yen is more of a sit down place, whereas in many of the other restaurants it feels like you&#39;re in someone&#39;s living room with glass door fridges and cramped spaces (which isn&#39;t necessarily bad, it&#39;s just a different feel).  <br><br>At Hai Yen the price is right and the delivery is always early, but you can also go have a nice sit down experience.",
