"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/aKpvkwjBYfFGU_sbAVnqdg/l.jpg",
"rating":"4.0",
"reviewcomment":"My girlfriend and I came here last night for our anniversary and had such a great night. We got to sit at the chefs table and watch everything get prepared, which was awesome. Chef Zoe and the other chefs were really friendly and it was fun to watch them make the food. <br>The food was fucking delicious. Our favorite dishes were the little salmon rolls, which came with delicious soy sauce glaze stuff, the bruschetta with cheese and fava beans (we kept saying NO BEAN LEFT BEHIND because they were so tasty), the tuna tartare, which came with this crazy delicious avocado cream that I want to put on everything I eat forever, and the grilled octopus, which was the best, most tender,<br>flavorful octopus I&#39;ve ever tasted in my life, and I used to live in coastal Spain. <br>The service was so, so good. Kat and Michelle were so funny and nice and we&#39;re really helpful at picking out our drinks, all of which were straight up delicious, particularly Las palabras, a mezcal cocktail. They were all really smooth and yummy and the perfect amount of booze and miraculously did not give me a monster hangover today. <br>I can&#39;t wait to come back and eat/drink a thousand more things.",
