"rating":"4.0",
"reviewcomment":"Found this place through a coupon deal, but I&#39;m so glad we did!  This is a charming and very comfortable French bistro just far enough from the loop that you feel like you are in a &#34;quiet zone&#34; but close enough that it only took us two minutes by car from Neiman Marcus shopping. We got there sort of on the early side on a Saturday night, but it soon filled up, so reservations for prime time slots might be a good idea.<br><br>Food was delicious: French onion soup was awesome; roast duck was perfect, salads creative and tasty, and crepes a la mode sinful.  Wine list awesome.  Service will impress: personable, attentive. and very responsive.  The owner, Kiki himself, stopped by to say hello and helped make this a great find for us!  Valet parking guys are very cool and will take good care of you. <br><br>Oh, reserving that last star for our next visit here, but I&#39;m pretty sure it is coming soon!",
