"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/pv8j0zf9exBYaH7cimR6Lg/l.jpg",
"rating":"3.5",
"reviewcomment":"I was looking for a place with a nice view to have dinner in Chicago. The restaurant is located right on the Chicago River. It offers an outside patio that is a must on a beautiful day. The beer/wine menu and dinner menu is small but has all the favorites you&#39;d expect at a gastro pub. <br>We started our dinner with their well known Popcorn made with bacon jalapeño and honey. What an amazing combination! It was spicy, sinful and sweet. I ordered the Short Ribs that was served with rapini and a baked potato. It was tasty but not spectacular. My date had the Steak and Frites which looked amazing. She loved the dish. <br>Overall a good restaurant with amazing views, all priced reasonably. It&#39;s a great date place on a beautiful day or just a place to hang out with friends located near the Magnificent Mile. I&#39;ll be back even if it&#39;s just for popcorn and beer.",
