"reviewcomment":"Let&#39;s end 2013 on a high note, shall we? Yuki Hana is my favorite sushi restaurant in Chicago. Bold statement? Sure. I don&#39;t sling around the F word often, and when I do, I mean it dagnabit. <br><br>First, Yuki has $3 dine-in happy hour everything from 12-7pm. Maki, sashimi, nigiri, appetizers, soups, and drinks. We&#39;re talking white tuna rolls, salmon rolls, tempura sweet potato, the works. To top it off, it&#39;s quality sushi that even my sushi snob friends enjoy eating. Carry-out happy hour brings the total to $4/each, and delivery is $5/each. But really, $5 for an 8 piece roll of quality sushi is still a huge bargain. They have a really large selection of choices as well, which is great for large groups that even consist of vegetarians. <br><br>Here are my favorites:<br>Chi Town Heat <br>Broken Mountain<br>White Men Can&#39;t Jump<br>Chicago Fire<br>312<br><br>Second, they have a full dinner menu with Japanese noodle and rice dishes. There are often Groupons or <a href='/redir?url=http%3A%2F%2FRestaurant.com&amp;s=0aab4cbd731f3d3b0d1453050d3abc56a8c80bd214e25469c7555b750dca8a51' target='_blank' rel='nofollow'>Restaurant.com</a> deals you can buy to try on the entrees, which I do recommend at least once. They have a much larger sushi menu and all the rolls are named after movies. The Point Break Roll (red snapper, avocado, cucumber and sweet carrot with eel sauce, crumbs and torched spicy scallop) is my favorite. <br><br>Third, the staff is so nice. I&#39;ve been coming here most Friday nights for years now, and no matter who is taking my order, I always have a pleasant experience. The dining room is clean and inviting, the decor is forever changing, and the restrooms are always kept nicely. If you&#39;re doing HH, make sure to leave a bigger tip. Just because the prices are slashed, doesn&#39;t mean the service is. <br><br>Know before you go:<br>-Happy Hour is 12-7 and not a minute later- it&#39;s also cash only.<br>-They have an ATM<br>-$5 corkage fee (or buy a bottle from them for $12)<br>-They have a variety of saki also available during HH for $5<br>-They now have a sushi roll on the HH menu made with siracha, jalepeno, and ghost pepper, the hottest pepper in the world. For $5, it&#39;s worth the one time Anthony Bourdain-style experience. The staff don&#39;t judge you when you spit it out and ask to be hosed down when your mouth is quite literally on fire.",
"reviewcount":"230",
"pricelevel":"$$",
