"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/7WjtXMUGfUlpRCqRdyIwFQ/l.jpg",
"rating":"3.5",
"reviewcomment":"We&#39;ve been here twice now, and I really am a big fan.<br><br>We stopped by in the summer with my husband and his parents.  We are all vegetarian and I remember everything being pretty good.  I do know the gnocchi I ordered was fabulous, so I was a bit bummed not to see it on the menu when we were here previously.  (I assumed they had seasonal items, but looking online it looks like they have different lunch/dinner menus, and we did go during lunch time the first time.)<br><br>So this time I ordered the Orecchiette con Cime Di Rapa, and my husband ordered a risotto.  My cousin was with us, but I can&#39;t remember what she ordered, it had meat so I wasn&#39;t interested.  Both the vegetarian dishes were wonderful.  I would easily order both of them again.<br><br>I haven&#39;t had a complaint about the service both times.  We actually had the same waiter both times. He was knowledgeable able to make suggestions and modifications for us etc.<br><br>I can&#39;t think of anything to complain about and the food was really good both times.  I&#39;ll certainly be back.",
