"rating":"4.0",
"reviewcomment":"When I moved to the city and found this restaurant it quickly became my go-to sushi place. The sushi here is ALWAYS fresh, their combinations are delicious, and they are reasonably priced to boot.<br><br>My absolute favorite staple here is the sakura roll! Cream cheese, spicy tuna, cucumber, avocado, and unagi sauce covered with tempura crumb. I am drooling just thinking about it! Their bowls are also surprisingly good.<br><br>I also love that this is a local business that you can tell is invested in every customer that comes in. Over the years I&#39;ve gotten to know the staff and it feels nice that when I come in with friends we are always greeted with warm smiles and genuinely friendly staff.<br><br>The only thing I will warn is that being a small, family run business this is the type of restaurant you go to to relax and enjoy company while waiting for your food. If you are in a rush or on a tight schedule, you may want to order ahead for carry out.",
