"reviewcomment":"Holy Delicious Vegetables! This is a casual eatery serving up bibimbap and paratha filled tacos. Hubs and I shared a sushi bowl and veggie tacos (very vegetarian friendly)- both were spectacular and mega fresh - and was the perfect amount of food for two reasonably hungry people.  The folks who (I think) own it were working the counter and were very pleasant and helped us decide on what to get.  Really good selection of bottled beverages to accompany, and have black and brown rice options for all meals.  The spicy sauce they have on the tables packs the perfect spice for my taste (not to hot, but hot enough and very flavorful).  I really like the decor and simplicity of the layout as well, very comfortable casual dining. (Cafeteria style -you order at the counter and find a seat and they bring your food to you).  <br><br>The best part - everything was really healthy, and there was no guilt after &#34;indulging&#34; in a wonderful meal!!  We can&#39;t wait to go back!!",
