"rating":"3.0",
"reviewcomment":"We just stopped in here for a quick pint to kill a little time before our Second City show across the street. It looks like that is where a lot of their business comes from both before and after Second City shows. We saw many other people both here and in our show. My mom and I are really more wine than beer drinkers, but when we saw they had Magner&#39;s Irish Cider we knew we had to try it. <br><br>We were able to sit at a table, even though we were not ordering food and they were fine with this. The environment really looks like an Irish pub with dark wood and lots of various pictures and trinkets on the walls. They also have many television screens broadcasting all the latest sports. My mom and I are not really interested in sports, but as it was a Monday night we saw groups gathering for MNF. The food we saw being served around us looked hearty and tasty. The prices seemed reasonable and service was efficient and friendly. It was a warm port on a chilly night and we greatly appreicated it.",
