"rating":"3.5",
"reviewcomment":"I have lost count of the number of times I have gone to Basil Leaf Cafe. So I will not rattle of exact menu items that I have had. Suffice it to say, I have had everything on the menu except for menu items that had nuts in them. The only one with nuts in it that I had was the berry salad, and that was because I requested the salad without the walnuts.<br><br>Starting with service, I&#39;m in love. It may be that I usually go with one other friend or solo, so I don&#39;t end up with an exasperated server who has to figure out the whims of a large party. Everything comes to the table without incident on the server&#39;s part or complaint on my part.<br><br>The quality of the food has never faltered, as far as I have experienced during my visits. I don&#39;t go to Basil Leaf Cafe often, but when I do, I&#39;m always glad that I did. I don&#39;t leave frustrated and I am alway stuffed to the point of having to waddle out of the restaurant. So, if I had to sum up Basil Leaf Cafe in one word, it would be &#34;Bravo!!!&#34;",
