"reviewcomment":"Friendly, courteous service, a wide variety for a vegetarian-only menu, and a decent, comfortable atmosphere. Recommended for the slightly adventurous or even those trying to eat out as vegetarian. The special rava masala dosai is not to be missed and goes with everything. Their spicy broth, rasam, is a bit strong for some but recommended if you can handle a little heat. Their potato and pea samosas is always a tasty appetizer, hot and flaky. A new entry, from their Indian-Chinese menu, is the Manchurian Broccoli &amp; Mushrooms; it has become a favorite of mine.<br><br>There&#39;s always a manager available to help select a well-balanced meal. They are first and foremost ready to help you enjoy your visit. <br><br>Don&#39;t forget to order a masala chai (tea) or coffee, perhaps with the meal, not just after it, as you may decide that one cup is not enough.",
