"reviewcomment":"What a huge difference from my first experience at Nia! Serious carb overload!! The food and service was great! My husband and I had the prefixed menu ($33 for 8 courses including dessert) which was a great deal. They substituted the meat courses for more vegetarian options. <br><br>The arugula sad was refreshing and had these spicy almonds on them! The baked goat cheese was fantastic! The milk cheese selection tasted like dried cheese on top of a pizza... Wouldn&#39;t recommend this. This mushroom risotto was good, just needed a little salt. The gnocchi was too buttery for my but my husband loved it. Entree Potions are small. <br><br>The red and white sangria were delicious! Great date night place with comfy outdoor seating on the corner of a busy street.",
