"rating":"3.5",
"reviewcomment":"This is a great place for catching up with friends, having informal meetings, or a place to hang out if you don&#39;t have anywhere to be. I love the cozy seats, the big tables by the door, and the late hours. <br><br>This cafe is unique because it&#39;s a sit down cafe, but it&#39;s definitely not the place to get your daily coffee if you&#39;re in a rush. There are about 2 employees and they can take a while before getting to your table. You want to make sure you have at least a good hour to kill if you want to stop by Kafein. <br><br>The drinks are gorgeous. I love ordering lattes here because they add cute latte art and really make the drinks an experience. I&#39;ve had some of their mochas and sweeter lattes and those drinks are really more of a dessert than a drink. <br><br>Honestly, I wish there were more locations like Kafein in Evanston. Kafein to me is a space to hang out, catch up, and relax, and as a college student, I wholeheartedly appreciate this space.",
