"reviewcomment":"This is a nice neighborhood gem of a place.<br>If you are a coffee nut and dont feel like going to starbucks like the other 364 days of the year, this is a good diversion.<br><br> The people who work here are very knowledgeable about their caffeine choices that they afford you.<br><br>Upstairs is a restaurant where they serve you all sorts of good stuff. I had a Crepe of some sort last week.<br>The first time I came here and ordered a bagel with cream cheese and it took like 20 minutes to get it to me. Thats kind of slow but you could tell they are working on this.<br><br>And yesterday I had the egg and vegetable burrito which they happily rearranged for me . I told them to take out the ham or pork and black beans and put in some cheese which they gladly did for me since I explained to them I dont eat pork.<br><br>I will come back. It&#39;s very cozy.",
