"reviewcomment":"Ralph Wiggum would most certainly Choo-Choo-Choose this place if he had a hankerin&#39; for a fried chicken sandwich. This old railroad car turned restaurant puts one bomb ass bird on a bun. Add the homemade onion rings and you&#39;ll def run a train on your dinner! (shout out to Augie from Role Models <a href='/redir?url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DkL-1SIFaBho&amp;s=f23d4a90eeba15dce7450f425685332b15fc001eaf406c1b997a9d752860cefe' target='_blank' rel='nofollow'>youtube.com/watch?v=kL-1…</a>)<br><br>Yes...quarters are close, but the staff is super neighborhood friendly and it is one of the more unique settings in all of Chicago. Definitely worth a stop in if you&#39;re ever near Chicago Ave and Ogden.",
