"reviewcomment":"Well that was fucking wonderful. <br><br>The skins on the boiled dumplings were, I shit you not, the texture of hand pulled noodles. That alone is reason why any review of 4 stars or less was clearly written by some sort of anti-yelp vigilantes taking mis-justice into their own hands. <br><br>The tofu appetizer was brilliant with well thought out flavors and every item on the dish absolutely needing to be there. <br><br>The egg custard, I mean, fuck man, those are just a thing if beauty. Flaky crust, sweet custardy egg, brûlée action on the top. God I need so many more of those in my life. Pro tip for NYC people- sneak some hot sauce on there and it channels pies and thighs salty sweet spicy amazing happiness and I don&#39;t want to be friends with you if you don&#39;t know that that is the best thing someone can say. <br><br>Here is the problem though. It&#39;s not they they give a shit, it&#39;s they give sooooo many shits. No, actually, I&#39;m pretty sure that they give ALL of the shits. Every single last one. A lot of shits is what I&#39;m saying. <br><br>So that means that the care in every dish we had was beautifully evident. This is obviously food made with love. Buuuuuut... Love takes time. We came during brunch, so it was relatively quiet and really gave them a chance to shine. I can only imagine the challenge of preparing food like this at high speed to keep up with the demands of a long line out the door. Looking at the negative reviews on here I have to assume that it is due to growing pains as they learn to keep up with the huge growth in demand (oh, and douches... Lotta douches writing bad reviews). <br><br>So be smart. Come at brunch or a slow night if you can so that you can get the true experience. If you go on a busy Thursday night then hopefully the food you get is as excellent as what I had but... I dunno, no promises?",
